INSERT INTO ladm_col_211.lc_viatipo (seq,iliCode,itfCode,dispName,inactive,description,thisClass,baseClass) VALUES (NULL,'Local',7,'Local','0','Conforman el sistema vial urbano menor y se conectan solamente con las vías colectoras','Levantamiento_Catastral_V2_11.LC_ViaTipo',NULL);
INSERT INTO ladm_col_211.lc_viatipo (seq,iliCode,itfCode,dispName,inactive,description,thisClass,baseClass) VALUES (NULL,'Metro_o_Metrovia',8,'Metro o metrovía','0','Es aquella de exclusiva destinación para las líneas de metro, independientemente de su configuración y que hacen parte integral de su infraestructura de operación.','Levantamiento_Catastral_V2_11.LC_ViaTipo',NULL);
