INSERT INTO ladm_col_211.lc_viatipo (seq,iliCode,itfCode,dispName,inactive,description,thisClass,baseClass) VALUES (NULL,'Principal',12,'Principal','0','Son aquellas troncales, transversales y accesos a capitales de Departamento que cumplen la función básica de integración de las principales zonas de producción y consumo del país y de éste con los demás países.','Levantamiento_Catastral_V2_11.LC_ViaTipo',NULL);
