INSERT INTO ladm_col_211.lc_viatipo (seq,iliCode,itfCode,dispName,inactive,description,thisClass,baseClass) VALUES (NULL,'Secundaria',14,'Secundaria','0','Son aquellas vías que unen las cabeceras municipales entre sí y/o que provienen de una cabecera municipal y conectan con una carretera Primaria.','Levantamiento_Catastral_V2_11.LC_ViaTipo',NULL);
INSERT INTO ladm_col_211.lc_viatipo (seq,iliCode,itfCode,dispName,inactive,description,thisClass,baseClass) VALUES (NULL,'Troncal',15,'Troncal','0','Vía de dos (2) calzadas con ocho o más carriles y con destinación exclusiva de las calzadas interiores para el tránsito de servicio público masivo.','Levantamiento_Catastral_V2_11.LC_ViaTipo',NULL);
INSERT INTO ladm_col_211.snr_clasepredioregistrotipo (seq,iliCode,itfCode,dispName,inactive,description,thisClass,baseClass) VALUES (NULL,'Rural',0,'Rural','0','Constituyen esta categoría los terrenos no aptos para el uso urbano, por razones de oportunidad, o por su destinación a usos agrícolas, ganaderos, forestales, de explotación de recursos naturales y actividades análogas. (Artículo 33, Ley 388 de 1997)','Datos_SNR_V2_11.SNR_ClasePredioRegistroTipo',NULL);
INSERT INTO ladm_col_211.snr_clasepredioregistrotipo (seq,iliCode,itfCode,dispName,inactive,description,thisClass,baseClass) VALUES (NULL,'Urbano',1,'Urbano','0','Constituyen el suelo urbano, las áreas del territorio distrital o municipal destinadas a usos urbanos por el plan de ordenamiento, que cuenten con infraestructura vial y redes primarias de energía, acueducto y alcantarillado, posibilitándose su urbanización y edificación, según sea el caso. Podrán pertenecer a esta categoría aquellas zonas con procesos de urbanización incompletos, comprendidos en áreas consolidadas con edificación, que se definan como áreas de mejoramiento integral en los planes de ordenamiento territorial.

Las áreas que conforman el suelo urbano serán delimitadas por perímetros y podrán incluir los centros poblados de los corregimientos. En ningún caso el perímetro urbano podrá ser mayor que el denominado perímetro de servicios públicos o sanitario. (Artículo 31, Ley 388 de 1997)','Datos_SNR_V2_11.SNR_ClasePredioRegistroTipo',NULL);
