INSERT INTO ladm_col_211.lc_puntotipo (seq,iliCode,itfCode,dispName,inactive,description,thisClass,baseClass) VALUES (NULL,'Poste',0,'Poste','0','Punto referido a los soportes verticales que sirven de apoyo,utilizados en la construcción de alambradas, tendidos eléctricos y telefónicos, televisión por cable, para iluminar calles, plazas o estadios y en las actividades agrícolas.','Levantamiento_Catastral_V2_11.LC_PuntoTipo',NULL);
INSERT INTO ladm_col_211.lc_puntotipo (seq,iliCode,itfCode,dispName,inactive,description,thisClass,baseClass) VALUES (NULL,'Construccion',1,'Construcción','0','Punto referido a las esquina o sección de los paramentos de las construcción y unidades de construcción.','Levantamiento_Catastral_V2_11.LC_PuntoTipo',NULL);
INSERT INTO ladm_col_211.lc_puntotipo (seq,iliCode,itfCode,dispName,inactive,description,thisClass,baseClass) VALUES (NULL,'Punto_Dinamico',2,'Punto dinámico','0','Punto referido a los puntos limitantes con elementos hidrográficos que por su condición pueden variar su límite con el tiempo.','Levantamiento_Catastral_V2_11.LC_PuntoTipo',NULL);
INSERT INTO ladm_col_211.lc_puntotipo (seq,iliCode,itfCode,dispName,inactive,description,thisClass,baseClass) VALUES (NULL,'Elemento_Natural',3,'elemento natural','0','Punto referido a los elementos naturales de la vegetación  como los árboles, arbustos o cualquier otra especie de la fauna.','Levantamiento_Catastral_V2_11.LC_PuntoTipo',NULL);
INSERT INTO ladm_col_211.lc_puntotipo (seq,iliCode,itfCode,dispName,inactive,description,thisClass,baseClass) VALUES (NULL,'Piedra',4,'Piedra','0','Punto referido a los elementos piedra o rocas.','Levantamiento_Catastral_V2_11.LC_PuntoTipo',NULL);
INSERT INTO ladm_col_211.lc_puntotipo (seq,iliCode,itfCode,dispName,inactive,description,thisClass,baseClass) VALUES (NULL,'Sin_Materializacion',5,'Sin materialización','0','Puntos referido a las áreas de campos abiertos, zonas boscosas, desérticas o cualquier otro tipo de espacio donde no se aprecia una clara delimitación.','Levantamiento_Catastral_V2_11.LC_PuntoTipo',NULL);
INSERT INTO ladm_col_211.lc_puntotipo (seq,iliCode,itfCode,dispName,inactive,description,thisClass,baseClass) VALUES (NULL,'Mojon',6,'Mojón','0','Puntos referidos a los mojones utilizados en topografía que tienen datos de coordenadas espaciales.','Levantamiento_Catastral_V2_11.LC_PuntoTipo',NULL);
INSERT INTO ladm_col_211.lc_puntotipo (seq,iliCode,itfCode,dispName,inactive,description,thisClass,baseClass) VALUES (NULL,'Incrustacion',7,'Incrustación','0','Puntos referidos a las incrustaciones realizadas en el suelo.','Levantamiento_Catastral_V2_11.LC_PuntoTipo',NULL);
INSERT INTO ladm_col_211.lc_puntotipo (seq,iliCode,itfCode,dispName,inactive,description,thisClass,baseClass) VALUES (NULL,'Pilastra',8,'Pilastra','0','Puntos referidos a las columnas verticales donde se encuentra materializado un punto con coordenadas espaciales.','Levantamiento_Catastral_V2_11.LC_PuntoTipo',NULL);
