INSERT INTO ladm_col_211.av_tipificacionconstrucciontipo (seq,iliCode,itfCode,dispName,inactive,description,thisClass,baseClass) VALUES (NULL,'Residencial_1_Bajo_Bajo',0,'Residencial 1 – (Bajo-Bajo)','0','Las viviendas que pertenecen a este grupo están construidas sin planeación alguna y generalmente con materiales de desecho tanto en las paredes como en los techos, construido o acondicionado para alojamiento, aunque no reúna las condiciones sanitarias indispensables. Generalmente carecen de algún servicio público básico y/o están ubicadas en zonas marginales no urbanizadas ni urbanizables, siendo de invasión y con escasez de vías de comunicación y transporte urbano.','Avaluos_V2_11.AV_TipificacionConstruccionTipo',NULL);
INSERT INTO ladm_col_211.av_tipificacionconstrucciontipo (seq,iliCode,itfCode,dispName,inactive,description,thisClass,baseClass) VALUES (NULL,'Residencial_2_Bajo',1,'Residencial 2 – (Bajo)','0','Las viviendas que pertenecen a este grupo están construidas con o sin planeación y generalmente con materiales como madera, prefabricado, ladrillo o bloque, cubiertas en zinc o teja de barro y con acabados sencillos, pueden disponer de algunos servicios públicos básicos, están situados por lo general en la periferia y disponen de algunas vías públicas sin pavimentar y escasos medios de transporte.','Avaluos_V2_11.AV_TipificacionConstruccionTipo',NULL);
INSERT INTO ladm_col_211.av_tipificacionconstrucciontipo (seq,iliCode,itfCode,dispName,inactive,description,thisClass,baseClass) VALUES (NULL,'Residencial_3_Medio_Bajo',2,'Residencial 3 – (Medio-Bajo)','0','Las viviendas que pertenecen a este grupo generalmente están constituidas por edificaciones técnicamente planeadas, con fachadas calificadas como regular, con muros de ladrillo o bloque, cubiertas de placa de concreto o teja en asbesto cemento. Generalmente cuentan con servicios públicos básicos, poseen vías de comunicación pavimentadas y medio de transporte urbano.','Avaluos_V2_11.AV_TipificacionConstruccionTipo',NULL);
INSERT INTO ladm_col_211.av_tipificacionconstrucciontipo (seq,iliCode,itfCode,dispName,inactive,description,thisClass,baseClass) VALUES (NULL,'Residencial_4_Medio',3,'Residencial 4 – (Medio)','0','Las viviendas que pertenecen a este grupo generalmente están constituidas por edificaciones técnicamente planeadas con fachada calificada de regular a buena, estructura en concreto, muros de ladrillo o bloque revocados, estucados y pintados, cubiertas de placa de concreto o teja en asbesto cemento; baños y cocinas calificados como medianos enchapados.','Avaluos_V2_11.AV_TipificacionConstruccionTipo',NULL);
INSERT INTO ladm_col_211.av_tipificacionconstrucciontipo (seq,iliCode,itfCode,dispName,inactive,description,thisClass,baseClass) VALUES (NULL,'Residencial_5_Medio_Alto',4,'Residencial 5 – (Medio-Alto)','0','Las viviendas que pertenecen a este grupo generalmente están constituidas por edificaciones totalmente terminadas y técnicamente planeadas con fachada calificada como buena así como sus acabados, estructura en concreto. Generalmente cuentan con muros de ladrillo o bloque, cubiertas de placa de concreto o con materiales de buena calidad; baños y cocinas calificados como buenos y tamaño entre mediano y grande.
Cuentan con todos los servicios públicos básicos y complementarios, con grandes zonas verdes, sociales y de recreación, parqueaderos y buenas vías de acceso.','Avaluos_V2_11.AV_TipificacionConstruccionTipo',NULL);
INSERT INTO ladm_col_211.av_tipificacionconstrucciontipo (seq,iliCode,itfCode,dispName,inactive,description,thisClass,baseClass) VALUES (NULL,'Residencial_6_Alto',5,'Residencial 6 – (Alto)','0','Las viviendas que pertenecen a este grupo generalmente están constituidas por edificaciones con grandes áreas, amplios jardines o apartamentos lujosos, paredes de bloque o ladrillo, cubiertas de placa de concreto o con materiales de excelente calidad y cuentan con los servicios públicos básicos y complementarios.
Estas viviendas están ubicadas en sectores exclusivos y disfrutan de amplias zonas verdes, sociales y de recreación, parqueaderos y excelentes vías de acceso.','Avaluos_V2_11.AV_TipificacionConstruccionTipo',NULL);
INSERT INTO ladm_col_211.av_tipificacionconstrucciontipo (seq,iliCode,itfCode,dispName,inactive,description,thisClass,baseClass) VALUES (NULL,'Comercial_Barrial',6,'Comercial barrial','0','Corresponde a la venta de bienes y servicios de consumo doméstico requeridos por la comunidad de residentes en barrios. Presenta dos modalidades principales de desarrollo: en áreas o espacios de edificaciones residenciales que fueron destinadas al uso comercial sin adecuaciones físicas importantes, ni del espacio mismo, ni del resto de la vivienda que se mantiene como tal; en establecimientos situados en edificaciones multifamiliares, en manzanas o en locales comerciales de las urbanizaciones.','Avaluos_V2_11.AV_TipificacionConstruccionTipo',NULL);
INSERT INTO ladm_col_211.av_tipificacionconstrucciontipo (seq,iliCode,itfCode,dispName,inactive,description,thisClass,baseClass) VALUES (NULL,'Comercial_Sectorial',7,'Comercial sectorial','0','Corresponde al destinado a la venta de productos y/o servicios ubicados en un sector consolidado o en proceso de consolidación.','Avaluos_V2_11.AV_TipificacionConstruccionTipo',NULL);
INSERT INTO ladm_col_211.lc_restricciontipo (seq,iliCode,itfCode,dispName,inactive,description,thisClass,baseClass) VALUES (NULL,'Servidumbre.Transito',0,'(Servidumbre) Tránsito','0','Se trata de predio sirviente que sufre el gravamen para permitir la comunicación uso y bienestar de otro predio. (Artículo 905 del C.C.)','Levantamiento_Catastral_V2_11.LC_RestriccionTipo',NULL);
INSERT INTO ladm_col_211.lc_restricciontipo (seq,iliCode,itfCode,dispName,inactive,description,thisClass,baseClass) VALUES (NULL,'Servidumbre.Aguas_Negras',1,'(Servidumbre) Aguas negras','0','Es el gravamen impuesto sobre un predio para permitir la salida de las aguas sobrantes de otro predio. (Art. 928 del C.C.).','Levantamiento_Catastral_V2_11.LC_RestriccionTipo',NULL);
INSERT INTO ladm_col_211.lc_restricciontipo (seq,iliCode,itfCode,dispName,inactive,description,thisClass,baseClass) VALUES (NULL,'Servidumbre.Aire',2,'(Servidumbre) Aire','0','Permite realizar y mantener las obras necesarias para la eficiencia y segura ventilación. Las empresas de servicios públicos podrán pasar por predios ajenos por vía aérea y realizar en ellos las actividades necesarias para prestar el servicio. (Artículo 215 del Decreto 1275 de 1970, artículo 57 de la Ley 142 de 1994).','Levantamiento_Catastral_V2_11.LC_RestriccionTipo',NULL);
INSERT INTO ladm_col_211.lc_restricciontipo (seq,iliCode,itfCode,dispName,inactive,description,thisClass,baseClass) VALUES (NULL,'Servidumbre.Energia_Electrica',3,'(Servidumbre) Energía eléctrica','0','Supone para las entidades públicas que tienen a su cargo la construcción de centrales generadoras, líneas de interconexión, transmisión y prestación del servicio público de distribución de energía eléctrica, la facultad de pasar por los predios afectados, por vía aérea, subterránea o superficial, las líneas de transmisión y distribución del fluido eléctrico, ocupar las zonas objeto de servidumbre, transitar por los mismos, adelantar las obras, ejercer la vigilancia, conservación y mantenimiento y emplear los demás medios necesarios para su ejercicio. (Artículo 18 de la Ley 126 de 1938 y Artículo 25 de la Ley 56 de 1981). (Artículo 57 de la Ley 142 de 1994).','Levantamiento_Catastral_V2_11.LC_RestriccionTipo',NULL);
INSERT INTO ladm_col_211.lc_restricciontipo (seq,iliCode,itfCode,dispName,inactive,description,thisClass,baseClass) VALUES (NULL,'Servidumbre.Gasoducto',4,'(Servidumbre) Gasoducto','0','Es el conjunto de actividades ordenadas a la distribución de gas combustible, por tubería u otro medio, desde un sitio de acopio de grandes volúmenes o desde un gasoducto central hasta la instalación de un consumidor final, incluyendo su conexión y medición.
Se constituye la servidumbre a favor de la explotación de los gases derivados del petróleo.
Cuando sea necesario las empresas que prestan el servicio podrán pasar por predios ajenos por vía subterránea o superficial los cables o tuberías, ocupar temporalmente las zonas que requieren esos predios, remover los cultivos y obstáculos de toda clase que se encuentren en ellos, transitar, adelantar las obras y ejercer vigilancia en ellos y en general realizar todas las actividades necesarias para prestar el servicio.
Las líneas de distribución de gas combustible, podrán atravesar los ríos, caudales, líneas férreas, puentes, calles, caminos, y cruzar acueductos, oleoductos, y otras líneas o conducciones. (Art. 14 númeral 28, y artículo 57 de la Ley 142 de 1994).','Levantamiento_Catastral_V2_11.LC_RestriccionTipo',NULL);
INSERT INTO ladm_col_211.lc_restricciontipo (seq,iliCode,itfCode,dispName,inactive,description,thisClass,baseClass) VALUES (NULL,'Servidumbre.Luz',5,'(Servidumbre) Luz','0','Tiene por objeto dar luz a un espacio cualquiera, cerrado y techado.
Se llama predio sirviente el que debe permitir el paso de la luz y predio dominante el que tiene derecho a ella. (Artículos 931 al 935 del Código Civil).','Levantamiento_Catastral_V2_11.LC_RestriccionTipo',NULL);
INSERT INTO ladm_col_211.lc_restricciontipo (seq,iliCode,itfCode,dispName,inactive,description,thisClass,baseClass) VALUES (NULL,'Servidumbre.Oleoducto',6,'(Servidumbre) Oleoducto','0','Se constituye a favor de la explotación de petróleo, comprendiendo el terreno suficiente para las estaciones de bombeo y demás dependencias necesarias para el funcionamiento de los oleoductos y el de establecer muelles, cargaderos y tuberías submarinas y fluviales. (Artículo 9 Decreto 1056 de 1954).','Levantamiento_Catastral_V2_11.LC_RestriccionTipo',NULL);
INSERT INTO ladm_col_211.lc_restricciontipo (seq,iliCode,itfCode,dispName,inactive,description,thisClass,baseClass) VALUES (NULL,'Servidumbre.Agua',7,'(Servidumbre) Agua','0','El predio inferior está sujeto a recibir las aguas que descienden del predio superior naturalmente, es decir, sin que la mano del hombre contribuya a ello. No se puede, por consiguiente, dirigir un albañal o acequia sobre el predio vecino, si no se ha constituido esta servidumbre especial. En el predio servil no se puede hacer cosa alguna que estorbe la servidumbre natural, ni el predio dominante, que la grave.','Levantamiento_Catastral_V2_11.LC_RestriccionTipo',NULL);
INSERT INTO ladm_col_211.lc_restricciontipo (seq,iliCode,itfCode,dispName,inactive,description,thisClass,baseClass) VALUES (NULL,'Servidumbre.Minera',8,'(Servidumbre) Minera','0','Para el ejercicio eficiente de la industria minera en todas sus fases y etapas, podrán establecerse las servidumbres que sean necesarias sobre los predios ubicados dentro o fuera del área objeto del título minero. Cuando, para la construcción, el montaje, la explotación, el acopio y el beneficio, en ejercicio de las servidumbres se requiera usar recursos naturales renovables, será indispensable que dicho uso esté autorizado por la autoridad ambiental, cuando la ley así lo exija. También procede el establecimiento de servidumbre sobre zonas, objeto de otros títulos mineros. Tales gravámenes no podrán impedir o dificultar la exploración o la explotación de la concesión que los soporte. (Art 166 Ley 685 de 2001)','Levantamiento_Catastral_V2_11.LC_RestriccionTipo',NULL);
INSERT INTO ladm_col_211.lc_restricciontipo (seq,iliCode,itfCode,dispName,inactive,description,thisClass,baseClass) VALUES (NULL,'Servidumbre.Legal_Hidrocarburos',9,'(Servidumbre) Legal de hidrocarburos','0','La industria de los hidrocarburos está declarada de utilidad pública en sus ramos de exploración, producción, transporte, refinación y distribución. Los predios deberán soportar todas las servidumbres legales que sean necesarias para realizar las actividades de exploración, producción y transporte de los hidrocarburos, salvo las excepciones establecidas por la ley. Se entenderá que la servidumbre de ocupación de terrenos comprenderá el derecho a construir la infraestructura necesaria en campo e instalar todas las obras y servicios propios para beneficio del recurso de los hidrocarburos y del ejercicio de las demás servidumbres que se requieran. (Art. 1 Ley 1274 de 2009)','Levantamiento_Catastral_V2_11.LC_RestriccionTipo',NULL);
INSERT INTO ladm_col_211.lc_restricciontipo (seq,iliCode,itfCode,dispName,inactive,description,thisClass,baseClass) VALUES (NULL,'Servidumbre.Medianeria',10,'(Servidumbre) Medianeria','0','Es el conjunto de derechos y obligaciones que dimanan de la existencia y disfrute en común de una pared, cerca, vallado, etc.
En todos los casos, y aun cuando conste que una cerca o pared divisoria pertenece exclusivamente a uno de los predios contiguos, el dueño del otro predio tendrá el derecho de hacer la medianería en todo o en parte, aun sin el consentimiento de su vecino, pagándole la mitad del valor del terreno en que está hecho el cerramiento, y la mitad del valor actual de la porción del cerramiento cuya medianería pretende. (Artículo 912 del C.C.).','Levantamiento_Catastral_V2_11.LC_RestriccionTipo',NULL);
INSERT INTO ladm_col_211.lc_restricciontipo (seq,iliCode,itfCode,dispName,inactive,description,thisClass,baseClass) VALUES (NULL,'Servidumbre.Alcantarillado',11,'(Servidumbre) Alcantarillado','0','Gravamen que afecta un predio, permitiendo que sobre el se conduzcan el alcantarillado que benefician a otro predio de diferente propietario.','Levantamiento_Catastral_V2_11.LC_RestriccionTipo',NULL);
INSERT INTO ladm_col_211.lc_restricciontipo (seq,iliCode,itfCode,dispName,inactive,description,thisClass,baseClass) VALUES (NULL,'Servidumbre.Acueducto',12,'(Servidumbre) Acueducto','0','Gravamen que afecta un predio, permitiendo que sobre el se conduzcan las aguas que benefician a otro predio de diferente propietario. (Artículos 919 a 930 del Código Civil; Artículo 214 del Decreto 1275 de 1970. Artículo 57 de la Ley 142 de 1998).','Levantamiento_Catastral_V2_11.LC_RestriccionTipo',NULL);
INSERT INTO ladm_col_211.snr_fuentetipo (seq,iliCode,itfCode,dispName,inactive,description,thisClass,baseClass) VALUES (NULL,'Acto_Administrativo',0,'Acto administrativo','0','Un acto administrativo es toda manifestación o declaración emanada de la administración pública en el ejercicio de potestades administrativas, mediante el que impone su voluntad sobre los derechos, libertades o intereses de otros sujetos públicos o privados y que queda bajo el del comienzo.','Datos_SNR_V2_11.SNR_FuenteTipo',NULL);
INSERT INTO ladm_col_211.snr_fuentetipo (seq,iliCode,itfCode,dispName,inactive,description,thisClass,baseClass) VALUES (NULL,'Escritura_Publica',1,'Escritura pública','0','Una escritura pública es un documento público en el que se realiza ante un notario público un determinado hecho o un derecho autorizado por dicho fedatario público, que firma con el otorgante u otorgantes,mostrando sobre la capacidad jurídica del contenido y de la fecha en que se realizó','Datos_SNR_V2_11.SNR_FuenteTipo',NULL);
INSERT INTO ladm_col_211.snr_fuentetipo (seq,iliCode,itfCode,dispName,inactive,description,thisClass,baseClass) VALUES (NULL,'Sentencia_Judicial',2,'Sentencia judicial','0','La sentencia es la resolución judicial definitiva dictada por un juez o tribunal que pone fin a la litis o caso sometido a su conocimiento y cierra definitivamente su actuación en el mismo','Datos_SNR_V2_11.SNR_FuenteTipo',NULL);
INSERT INTO ladm_col_211.snr_fuentetipo (seq,iliCode,itfCode,dispName,inactive,description,thisClass,baseClass) VALUES (NULL,'Documento_Privado',3,'Documento privado','0','Documento que contiene un compromiso entre dos o más personas que lo firman.','Datos_SNR_V2_11.SNR_FuenteTipo',NULL);
