INSERT INTO ladm_col_211.lc_objetoconstrucciontipo (seq,iliCode,itfCode,dispName,inactive,description,thisClass,baseClass) VALUES (NULL,'Enchape_Banio.Marmol_Enchape_Lujoso',42,'(Enchape de baño) Mármol, enchape lujoso','0',NULL,'Levantamiento_Catastral_V2_11.LC_ObjetoConstruccionTipo',NULL);
INSERT INTO ladm_col_211.lc_objetoconstrucciontipo (seq,iliCode,itfCode,dispName,inactive,description,thisClass,baseClass) VALUES (NULL,'Mobiliario_Banio.Pobre',43,'(Mobiliario de baño) Pobre','0','Cuenta con uno o máximo dos servicios entre lavamanos retrete y ducha; los porcelanizados, en caso de tenerlos, son muy económicos; exceptuando los gabinetes pequeños de latón, no tiene ningún otro mobiliario ni divisiones.','Levantamiento_Catastral_V2_11.LC_ObjetoConstruccionTipo',NULL);
INSERT INTO ladm_col_211.lc_objetoconstrucciontipo (seq,iliCode,itfCode,dispName,inactive,description,thisClass,baseClass) VALUES (NULL,'Mobiliario_Banio.Sencillo',44,'(Mobiliario de baño) Sencillo','0','Esta categoría de baños cuenta con tres servicios.  Los porcenalizados de esta categoría son del tipo standard, se encuentran gabinetes muy sencillos y en latón y ocasionalmente pequeños armarios en madera burda o metal.','Levantamiento_Catastral_V2_11.LC_ObjetoConstruccionTipo',NULL);
INSERT INTO ladm_col_211.lc_objetoconstrucciontipo (seq,iliCode,itfCode,dispName,inactive,description,thisClass,baseClass) VALUES (NULL,'Mobiliario_Banio.Regular',45,'(Mobiliario de baño) Regular','0','Tiene mínimo tres servicios pero de tipo económico.  Tienen gabinetes de regular tamaño, algunas veces empotrados, lavamanos con mueble o pedestal y división de la ducha.','Levantamiento_Catastral_V2_11.LC_ObjetoConstruccionTipo',NULL);
INSERT INTO ladm_col_211.lc_objetoconstrucciontipo (seq,iliCode,itfCode,dispName,inactive,description,thisClass,baseClass) VALUES (NULL,'Mobiliario_Banio.Bueno',46,'(Mobiliario de baño) Bueno','0','Cuenta como mínimo con cuatro servicios, los porcenalizados son finos, en colores, con pedestales, adornos y grifería fina, tina, planchas de lavamanos generalmente en mármol con muebles en madera trabajada de tamaños regulares a grandes, con espejos más o menos grandes con luz integrada, la tina forma parte de la ducha, en el mismo espacio.

También se encuentran pequeños armarios y gabinetes auxiliares en madera o acrílico, empotrados o sobrepuestos.  Normalmente presentan división de la ducha, construida en aluminio y cristalita.','Levantamiento_Catastral_V2_11.LC_ObjetoConstruccionTipo',NULL);
