INSERT INTO ladm_col_211.lc_prediotipo (seq,iliCode,itfCode,dispName,inactive,description,thisClass,baseClass) VALUES (NULL,'Publico.Baldio',0,'(Público) Baldío','0','Es un bien inmueble de propiedad de la Nación y ubicado en zonas rurales','Levantamiento_Catastral_V2_11.LC_PredioTipo',NULL);
INSERT INTO ladm_col_211.lc_prediotipo (seq,iliCode,itfCode,dispName,inactive,description,thisClass,baseClass) VALUES (NULL,'Publico.Fiscal',1,'(Público) Fiscal','0','Los bienes de la Unión cuyo uso no pertenece generalmente a los habitantes, se llaman bienes de la Unión o bienes fiscales','Levantamiento_Catastral_V2_11.LC_PredioTipo',NULL);
INSERT INTO ladm_col_211.lc_prediotipo (seq,iliCode,itfCode,dispName,inactive,description,thisClass,baseClass) VALUES (NULL,'Publico.Patrimonial',2,'(Público) Patrimonial','0','Son bienes patrimoniales los de titularidad de las administraciones públicas que no tengan el carácter de bienes de dominio público, es decir, que no estén destinados directamente al uso público o afectados a un servicio público. Si no consta la afectación de un bien se presume su carácter patrimonial.','Levantamiento_Catastral_V2_11.LC_PredioTipo',NULL);
INSERT INTO ladm_col_211.lc_prediotipo (seq,iliCode,itfCode,dispName,inactive,description,thisClass,baseClass) VALUES (NULL,'Publico.Uso_Publico',3,'(Público) Uso público','0','Son aquellos inmuebles de dominio público cuyo uso pertenece a todos los habitantes del territorio nacional, destinados al uso o disfrute colectivo.','Levantamiento_Catastral_V2_11.LC_PredioTipo',NULL);
INSERT INTO ladm_col_211.lc_prediotipo (seq,iliCode,itfCode,dispName,inactive,description,thisClass,baseClass) VALUES (NULL,'Privado',4,'(Privado)','0','Es aquel que ha salido del patrimonio del estado, cuenta con un propietario inscrito en el folio de matrícula y se considera propiedad privada en los términos del artículo 48 de la Ley 160 de 1993.','Levantamiento_Catastral_V2_11.LC_PredioTipo',NULL);
INSERT INTO ladm_col_211.lc_prediotipo (seq,iliCode,itfCode,dispName,inactive,description,thisClass,baseClass) VALUES (NULL,'Territorio_Colectivo',5,'(Territorio colectivo)','0','es el predio que pertenece al estado y/o cuyo propietario es una entidad de derecho público','Levantamiento_Catastral_V2_11.LC_PredioTipo',NULL);
INSERT INTO ladm_col_211.lc_prediotipo (seq,iliCode,itfCode,dispName,inactive,description,thisClass,baseClass) VALUES (NULL,'Vacante',6,'Vacante','0','Son bienes inmuebles que se encuentran dentro de territorio respectivo a cargo de la Nación, sin dueño aparente o conocido','Levantamiento_Catastral_V2_11.LC_PredioTipo',NULL);
INSERT INTO ladm_col_211.lc_estadoconservaciontipo (seq,iliCode,itfCode,dispName,inactive,description,thisClass,baseClass) VALUES (NULL,'Malo',0,'Malo','0','Se agrupan en este concepto, aquellas estructuras con el mayor grado de deterioro que se puedan encontrar, en condiciones precarias lo cual las hace prácticamente inhabitables.  Generalmente se presenta en construcciones antiguas o con material de muy mala calidad.','Levantamiento_Catastral_V2_11.LC_EstadoConservacionTipo',NULL);
INSERT INTO ladm_col_211.lc_estadoconservaciontipo (seq,iliCode,itfCode,dispName,inactive,description,thisClass,baseClass) VALUES (NULL,'Regular',1,'Regular','0','En esta categoría, se clasifican aquellas estructuras que tienen algunos daños menores, (agrietamiento de paredes, hundimiento de pisos, etc.) pero que todavía se encuentran en condiciones aceptables, sin peligros eminentes o exigencias imperativa de reparaciones inmediatas.  Se presenta con frecuencia en construcciones más o menos antiguas o materiales de regular calidad.','Levantamiento_Catastral_V2_11.LC_EstadoConservacionTipo',NULL);
INSERT INTO ladm_col_211.lc_estadoconservaciontipo (seq,iliCode,itfCode,dispName,inactive,description,thisClass,baseClass) VALUES (NULL,'Bueno',2,'Bueno','0','Se calificarán como tales, aquellas estructuras, no necesariamente nuevas, que se hallan cumpliendo a cabalidad con la función para las que fueron construidas, no demuestran deterioro, al menos visibles, y por efectos de uso se encuentran solamente un tanto deslucidas y sus materiales son de buena calidad.','Levantamiento_Catastral_V2_11.LC_EstadoConservacionTipo',NULL);
INSERT INTO ladm_col_211.lc_estadoconservaciontipo (seq,iliCode,itfCode,dispName,inactive,description,thisClass,baseClass) VALUES (NULL,'Excelente',3,'Excelente','0','Se define en este grado, el estado de conservación de una estructura nueva en la que no se vislumbra deterioro, no se observa daño y en la cual los materiales y los acabados son de óptima calidad.','Levantamiento_Catastral_V2_11.LC_EstadoConservacionTipo',NULL);
INSERT INTO ladm_col_211.col_metodoproducciontipo (seq,iliCode,itfCode,dispName,inactive,description,thisClass,baseClass) VALUES (NULL,'Metodo_Directo',0,'Método directo','0','Aquellos que requieren una visita campo con el fin de
recolectar la realidad de los bienes inmuebles.','LADM_COL_V1_7.LADM_Nucleo.COL_MetodoProduccionTipo',NULL);
INSERT INTO ladm_col_211.col_metodoproducciontipo (seq,iliCode,itfCode,dispName,inactive,description,thisClass,baseClass) VALUES (NULL,'Metodo_Indirecto',1,'Método indirecto','0','aquellos métodos identificación física, jurídica y
económica de los inmuebles a través del uso de de sensores
remotos, integración registros administrativos, modelos ísticos y
econométricos, análisis de Big Data y fuentes secundarias como
observatorios inmobiliarios, su posterior incorporación en la base catastral.','LADM_COL_V1_7.LADM_Nucleo.COL_MetodoProduccionTipo',NULL);
INSERT INTO ladm_col_211.col_metodoproducciontipo (seq,iliCode,itfCode,dispName,inactive,description,thisClass,baseClass) VALUES (NULL,'Medoto_Declarativo_y_Colaborativo',2,'Metodo declarativo y colaborativo','0','Son los derivados participación de la comunidad en el suministro de información que sirva como insumo para el desarrollo de los procesos catastrales. Los gestores catastrales propenderán por la adopción nuevas tecnologías y procesos comunitarios que faciliten la participación los ciudadanos.','LADM_COL_V1_7.LADM_Nucleo.COL_MetodoProduccionTipo',NULL);
