INSERT INTO ladm_col_211.lc_derechotipo (seq,iliCode,itfCode,dispName,inactive,description,thisClass,baseClass) VALUES (NULL,'Ocupacion',1,'Ocupación','0','Por la ocupación se adquiere el dominio de las cosas que no pertenecen a nadie, y cuya adquisición no es prohibida por las leyes o por el derecho internacional.','Levantamiento_Catastral_V2_11.LC_DerechoTipo',NULL);
INSERT INTO ladm_col_211.lc_derechotipo (seq,iliCode,itfCode,dispName,inactive,description,thisClass,baseClass) VALUES (NULL,'Posesion',2,'Posesión','0','La posesión es la tenencia de una cosa determinada con ánimo de señor o dueño, sea que el dueño o el que se da por tal, tenga la cosa por sí mismo, o por otra persona que la tenga en lugar y a nombre de él. El poseedor es reputado dueño, mientras otra persona no justifique serlo.','Levantamiento_Catastral_V2_11.LC_DerechoTipo',NULL);
