INSERT INTO ladm_col_211.av_influenciavialruraltipo (seq,iliCode,itfCode,dispName,inactive,description,thisClass,baseClass) VALUES (NULL,'Regulares_3',2,'Regulares 3 - Pavimentadas, vía angosta','0','Aquellas que presentan vías de tipo 3 y 4. De regular desarrollo agropecuario; por lo general son zonas de ganadería extensiva o de agricultura de subsistencia. Las pendientes van de inclinadas a fuertemente inclinadas. Más alejadas de los centros Urbanos. Pavimentadas, vía angosta.','Avaluos_V2_11.AV_InfluenciaVialRuralTipo',NULL);
INSERT INTO ladm_col_211.av_influenciavialruraltipo (seq,iliCode,itfCode,dispName,inactive,description,thisClass,baseClass) VALUES (NULL,'Regulares_4',3,'Regulares 4 - Sin pavimentar, vía angosta','0','Aquellas que presentan vías de tipo 3 y 4. De regular desarrollo agropecuario; por lo general son zonas de ganadería extensiva o de agricultura de subsistencia. Las pendientes van de inclinadas a fuertemente inclinadas. Más alejadas de los centros Urbanos. Sin pavimentar, vía angosta.','Avaluos_V2_11.AV_InfluenciaVialRuralTipo',NULL);
INSERT INTO ladm_col_211.av_influenciavialruraltipo (seq,iliCode,itfCode,dispName,inactive,description,thisClass,baseClass) VALUES (NULL,'Malas_5',4,'Malas 5 - Transitable en tiempo seco','0','Presentan en su mayoría vías de tipo 5 en adelante; zonas dedicadas a la agricultura y ganadería extensiva; zonas de pendiente fuertemente inclinadas y relieve quebrado o escarpado. Si se presentan zonas con pendientes menores estas, por lo general, están erosionadas. Las vías malas se presentan, con mayor frecuencia en zonas muy alejadas de los centros urbanos.
Transitables en tiempo seco','Avaluos_V2_11.AV_InfluenciaVialRuralTipo',NULL);
INSERT INTO ladm_col_211.av_influenciavialruraltipo (seq,iliCode,itfCode,dispName,inactive,description,thisClass,baseClass) VALUES (NULL,'Malas_6',5,'Malas 6 - Carreteable sólo para vehículos medianos','0','Presentan en su mayoría vías de tipo 5 en adelante; zonas dedicadas a la agricultura y ganadería extensiva; zonas de pendiente fuertemente inclinadas y relieve quebrado o escarpado. Si se presentan zonas con pendientes menores estas, por lo general, están erosionadas. Las vías malas se presentan, con mayor frecuencia en zonas muy alejadas de los centros urbanos.
Carreteable solo para vehículos','Avaluos_V2_11.AV_InfluenciaVialRuralTipo',NULL);
INSERT INTO ladm_col_211.av_influenciavialruraltipo (seq,iliCode,itfCode,dispName,inactive,description,thisClass,baseClass) VALUES (NULL,'Malas_7',6,'Malas 7 - Camino real o de herradura','0','Presentan en su mayoría vías de tipo 5 en adelante; zonas dedicadas a la agricultura y ganadería extensiva; zonas de pendiente fuertemente inclinadas y relieve quebrado o escarpado. Si se presentan zonas con pendientes menores estas, por lo general, están erosionadas. Las vías malas se presentan, con mayor frecuencia en zonas muy alejadas de los centros urbanos.
Camino real o de herradura.','Avaluos_V2_11.AV_InfluenciaVialRuralTipo',NULL);
INSERT INTO ladm_col_211.av_influenciavialruraltipo (seq,iliCode,itfCode,dispName,inactive,description,thisClass,baseClass) VALUES (NULL,'Sin_Vias_8',7,'Sin vías 8 - Sendero','0','Carecen de vías de comunicación importantes y solo se presentan caminos para el tránsito de personas o animales de carga. Sendero','Avaluos_V2_11.AV_InfluenciaVialRuralTipo',NULL);
INSERT INTO ladm_col_211.av_influenciavialruraltipo (seq,iliCode,itfCode,dispName,inactive,description,thisClass,baseClass) VALUES (NULL,'Sin_Vias_9',8,'Sin vías 9 - Sin vías','0','Carecen de vías de comunicación importantes y solo se presentan caminos para el tránsito de personas o animales de carga. Sin vías.','Avaluos_V2_11.AV_InfluenciaVialRuralTipo',NULL);
