INSERT INTO ladm_col_211.lc_fuenteadministrativatipo (seq,iliCode,itfCode,dispName,inactive,description,thisClass,baseClass) VALUES (NULL,'Escritura_Publica',0,'Escritura pública','0','Una escritura pública es un documento público en el que se realiza ante un notario público un determinado hecho o un derecho autorizado por dicho fedatario público, que firma con el otorgante u otorgantes,mostrando sobre la capacidad jurídica del contenido y de la fecha en que se realizó','Levantamiento_Catastral_V2_11.LC_FuenteAdministrativaTipo',NULL);
INSERT INTO ladm_col_211.lc_fuenteadministrativatipo (seq,iliCode,itfCode,dispName,inactive,description,thisClass,baseClass) VALUES (NULL,'Sentencia_Judicial',1,'Sentencia judicial','0','La sentencia es la resolución judicial definitiva dictada por un juez o tribunal que pone fin a la litis o caso sometido a su conocimiento y cierra definitivamente su actuación en el mismo','Levantamiento_Catastral_V2_11.LC_FuenteAdministrativaTipo',NULL);
INSERT INTO ladm_col_211.lc_fuenteadministrativatipo (seq,iliCode,itfCode,dispName,inactive,description,thisClass,baseClass) VALUES (NULL,'Acto_Administrativo',2,'Acto administrativo','0','Un acto administrativo es toda manifestación o declaración emanada de la administración pública en el ejercicio de potestades administrativas, mediante el que impone su voluntad sobre los derechos, libertades o intereses de otros sujetos públicos o privados y que queda bajo el del comienzo.','Levantamiento_Catastral_V2_11.LC_FuenteAdministrativaTipo',NULL);
