INSERT INTO ladm_col_211.snr_personatitulartipo (seq,iliCode,itfCode,dispName,inactive,description,thisClass,baseClass) VALUES (NULL,'Persona_Natural',0,'Persona natural','0','Se refiere a la persona humana.','Datos_SNR_V2_11.SNR_PersonaTitularTipo',NULL);
