INSERT INTO ladm_col_211.lc_clasecalificaciontipo (seq,iliCode,itfCode,dispName,inactive,description,thisClass,baseClass) VALUES (NULL,'Estructura',0,'Estructura','0','En construcción, es el nombre que recibe el conjunto de elementos, unidos, ensamblados o conectados entre sí, que tienen la función de recibir cargas, soportar esfuerzos y transmitir esas cargas al suelo, garantizando así la función estático - resistente de la construcción. Sus componentes son: armazon, muros y cubierta.','Levantamiento_Catastral_V2_11.LC_ClaseCalificacionTipo',NULL);
