INSERT INTO ladm_col_211.snr_documentotitulartipo (seq,iliCode,itfCode,dispName,inactive,description,thisClass,baseClass) VALUES (NULL,'Cedula_Ciudadania',0,'Cédula de ciudadanía','0','Es un documento emitido por la Registraduría Nacional del Estado Civil para permitir la identificación personal de los ciudadanos.','Datos_SNR_V2_11.SNR_DocumentoTitularTipo',NULL);
INSERT INTO ladm_col_211.snr_documentotitulartipo (seq,iliCode,itfCode,dispName,inactive,description,thisClass,baseClass) VALUES (NULL,'Cedula_Extranjeria',1,'Cédula de extranjería','0','Es el documento que cumple los fines de identificación de los extranjeros en el territorio nacional y su utilización deberá estar acorde con la visa otorgada al extranjero.','Datos_SNR_V2_11.SNR_DocumentoTitularTipo',NULL);
INSERT INTO ladm_col_211.snr_documentotitulartipo (seq,iliCode,itfCode,dispName,inactive,description,thisClass,baseClass) VALUES (NULL,'NIT',2,'NIT','0','El Número de Identificación Tributaria (NIT) es un código privado, secreto e intransferible que solamente debe conocer el contribuyente.','Datos_SNR_V2_11.SNR_DocumentoTitularTipo',NULL);
INSERT INTO ladm_col_211.snr_documentotitulartipo (seq,iliCode,itfCode,dispName,inactive,description,thisClass,baseClass) VALUES (NULL,'Tarjeta_Identidad',3,'Tarjeta de identidad','0','Es el documento oficial que hace las veces de identificación para los menores de edad entre los 7 y los 18 años.','Datos_SNR_V2_11.SNR_DocumentoTitularTipo',NULL);
INSERT INTO ladm_col_211.snr_documentotitulartipo (seq,iliCode,itfCode,dispName,inactive,description,thisClass,baseClass) VALUES (NULL,'Registro_Civil',4,'Registro civil','0','Registro donde se hacen constar por autoridades competentes los nacimientos, matrimonios, defunciones y demás hechos relativos al estado civil de las personas. En el modelo se tendrá en cuenta el número de registro como identificación personal de las personas de 0 a 7 años.','Datos_SNR_V2_11.SNR_DocumentoTitularTipo',NULL);
INSERT INTO ladm_col_211.snr_documentotitulartipo (seq,iliCode,itfCode,dispName,inactive,description,thisClass,baseClass) VALUES (NULL,'NUIP',5,'NUIP','0','El Número Único de Identificación Personal, es el número que permite identificar a los colombianos durante toda su vida.','Datos_SNR_V2_11.SNR_DocumentoTitularTipo',NULL);
INSERT INTO ladm_col_211.snr_documentotitulartipo (seq,iliCode,itfCode,dispName,inactive,description,thisClass,baseClass) VALUES (NULL,'Secuencial_SNR',6,'Secuencial SNR','0','Es un consecutivo asignado automáticamente en registro en lugar del número de la identificación de la persona que hace el trámite, se usa especialmente en trámites de construcción cuando el proyecto está a nombre de una Fiducia el cual tiene el mismo número del banco.','Datos_SNR_V2_11.SNR_DocumentoTitularTipo',NULL);
