INSERT INTO ladm_col_211.lc_construcciontipo (seq,iliCode,itfCode,dispName,inactive,description,thisClass,baseClass) VALUES (NULL,'Convencional',0,'Convencional','0','Se refiere aquellas construcciones de uso residencial, comercial e industrial.','Levantamiento_Catastral_V2_11.LC_ConstruccionTipo',NULL);
INSERT INTO ladm_col_211.lc_construcciontipo (seq,iliCode,itfCode,dispName,inactive,description,thisClass,baseClass) VALUES (NULL,'No_Convencional',1,'No convencional','0','Se refiere aquellas construcciones consideradas anexos de construcción.','Levantamiento_Catastral_V2_11.LC_ConstruccionTipo',NULL);
INSERT INTO ladm_col_211.av_usosuelourbanotipo (seq,iliCode,itfCode,dispName,inactive,description,thisClass,baseClass) VALUES (NULL,'Residencial',0,'Residencial','0','Es aquel espacio geográfico dedicado a la vivienda, de tipo unifamiliar o multifamiliar.','Avaluos_V2_11.AV_UsoSueloUrbanoTipo',NULL);
INSERT INTO ladm_col_211.av_usosuelourbanotipo (seq,iliCode,itfCode,dispName,inactive,description,thisClass,baseClass) VALUES (NULL,'Comercial',1,'Comercial','0','Es aquel espacio geográfico dedicado a la venta de mercancías (almacenes, centros comerciales, aeropuerto, etc.) y de servicios (oficinas, hoteles, restaurantes, bancos, consultorios, etc.). Se incluyen corredores comerciales en barrios residenciales.','Avaluos_V2_11.AV_UsoSueloUrbanoTipo',NULL);
INSERT INTO ladm_col_211.av_usosuelourbanotipo (seq,iliCode,itfCode,dispName,inactive,description,thisClass,baseClass) VALUES (NULL,'Industrial',2,'Industrial','0','Es aquel espacio geográfico dedicado a la transformación de materia prima en mercancías y a la reparación de maquinaria y equipos, con las características propias de una industria (Altura mayor de 2.50 mts, columnas, vigas perimetrales, cerchas, existencia puente grúas, Luces mayores de 6 mts). Incluye zonas de almacenamiento y zonas francas portuarias y aeroportuarias.','Avaluos_V2_11.AV_UsoSueloUrbanoTipo',NULL);
INSERT INTO ladm_col_211.av_usosuelourbanotipo (seq,iliCode,itfCode,dispName,inactive,description,thisClass,baseClass) VALUES (NULL,'Institucional',3,'Institucional','0','Es aquel espacio geográfico dedicado a la administración y prestación de servicios del estado (hospitales, colegios, alcaldía, canchas deportivas, etc.) y que no se encuentra clasificado en otros usos.','Avaluos_V2_11.AV_UsoSueloUrbanoTipo',NULL);
INSERT INTO ladm_col_211.av_usosuelourbanotipo (seq,iliCode,itfCode,dispName,inactive,description,thisClass,baseClass) VALUES (NULL,'Lote',4,'Lote','0','Es aquel espacio geográfico no construido que puede contar o no con algún tipo de obra de urbanismo. Dentro de esta clasificación se incluirán los cuerpos de agua, los cuales se consideran como lotes no urbanizables.','Avaluos_V2_11.AV_UsoSueloUrbanoTipo',NULL);
INSERT INTO ladm_col_211.lc_interesadotipo (seq,iliCode,itfCode,dispName,inactive,description,thisClass,baseClass) VALUES (NULL,'Persona_Natural',0,'Persona natural','0','Se refiere a la persona humana.','Levantamiento_Catastral_V2_11.LC_InteresadoTipo',NULL);
INSERT INTO ladm_col_211.lc_interesadotipo (seq,iliCode,itfCode,dispName,inactive,description,thisClass,baseClass) VALUES (NULL,'Persona_Juridica',1,'Persona jurídica','0','Se llama persona jurídica, una persona ficticia, capaz de ejercer derechos y contraer obligaciones civiles, y de ser representada judicial y extrajudicialmente. Las personas jurídicas son de dos especies: corporaciones y fundaciones de beneficencia pública.','Levantamiento_Catastral_V2_11.LC_InteresadoTipo',NULL);
INSERT INTO ladm_col_211.lc_usouconstipo (seq,iliCode,itfCode,dispName,inactive,description,thisClass,baseClass) VALUES (NULL,'Residencial.Apartamentos_4_y_mas_pisos_en_PH',0,'(Residencial) Apartamentos 4 y más pisos en PH','0','Es una vivienda que comprende una o más habitaciones, en un edificio de varios pisos 4 o más pisos sometido en régimen de propiedad horizontal.','Levantamiento_Catastral_V2_11.LC_UsoUConsTipo',NULL);
INSERT INTO ladm_col_211.lc_usouconstipo (seq,iliCode,itfCode,dispName,inactive,description,thisClass,baseClass) VALUES (NULL,'Residencial.Apartamentos_En_Edificio_4_y_5_Pisos_Cartagena',1,'(Residencial) Apartamentos en Edificio de 4 y 5 Pisos (Cartagena)','0','Es una vivienda que comprende una o más habitaciones, en un edificio de 4 o 5 pisos.','Levantamiento_Catastral_V2_11.LC_UsoUConsTipo',NULL);
INSERT INTO ladm_col_211.lc_usouconstipo (seq,iliCode,itfCode,dispName,inactive,description,thisClass,baseClass) VALUES (NULL,'Residencial.Apartamentos_Mas_De_4_Pisos',2,'(Residencial) Apartamentos mas de 4 Pisos','0','Es una vivienda que comprende una o más habitaciones, en un edificio de varios pisos 4 o más pisos','Levantamiento_Catastral_V2_11.LC_UsoUConsTipo',NULL);
INSERT INTO ladm_col_211.lc_usouconstipo (seq,iliCode,itfCode,dispName,inactive,description,thisClass,baseClass) VALUES (NULL,'Residencial.Barracas',3,'(Residencial) Barracas','0','Dormitorios de las furezar armadas y militares','Levantamiento_Catastral_V2_11.LC_UsoUConsTipo',NULL);
INSERT INTO ladm_col_211.lc_usouconstipo (seq,iliCode,itfCode,dispName,inactive,description,thisClass,baseClass) VALUES (NULL,'Residencial.Casa_Elbas',4,'(Residencial) Casa Elbas','0','Típica casa con mampostería de piedra, pizarra y madera. Ha sido rehabilitada respetando escrupulosamente sus características exteriores y decorada con un interior tradicional','Levantamiento_Catastral_V2_11.LC_UsoUConsTipo',NULL);
INSERT INTO ladm_col_211.lc_usouconstipo (seq,iliCode,itfCode,dispName,inactive,description,thisClass,baseClass) VALUES (NULL,'Residencial.Depositos_Lockers',5,'Depósitos o lockers','0','(en propiedad Horizontal): Edificación destinada al almacenamiento o resguardo de enceres, generalmente ubicados en los sótanos y semisótanos de los edificios, junto a los parqueaderos. Las áreas de estos depósitos generalmente no supera los 25 metros cuadrados.','Levantamiento_Catastral_V2_11.LC_UsoUConsTipo',NULL);
INSERT INTO ladm_col_211.lc_usouconstipo (seq,iliCode,itfCode,dispName,inactive,description,thisClass,baseClass) VALUES (NULL,'Residencial.Garajes_Cubiertos',6,'(Residencial) Garajes Cubiertos','0','Es el lugar cubierto, destinado al estacionamiento privado de vehículos.','Levantamiento_Catastral_V2_11.LC_UsoUConsTipo',NULL);
INSERT INTO ladm_col_211.lc_usouconstipo (seq,iliCode,itfCode,dispName,inactive,description,thisClass,baseClass) VALUES (NULL,'Residencial.Garajes_En_PH',7,'(Residencial) Garajes en PH','0','Es el lugar cubierto, destinado al estacionamiento privado o comunal en viviendas sometidas a   régimen de propiedad  horizontal.','Levantamiento_Catastral_V2_11.LC_UsoUConsTipo',NULL);
INSERT INTO ladm_col_211.lc_usouconstipo (seq,iliCode,itfCode,dispName,inactive,description,thisClass,baseClass) VALUES (NULL,'Residencial.Vivienda_Colonial',8,'(Residencial) Vivienda Colonial','0','La vivienda colonial siempre se desarrolla en un solo nivel ya sea en la planta baja o en la planta alta de las edificaciones, sin importar la jerarquía de ‘estas, distribuida en crujías o bloques, paralelos o perpendiculares a la calle en forma de  “I” ,de “L”, de “C” o de “O”','Levantamiento_Catastral_V2_11.LC_UsoUConsTipo',NULL);
INSERT INTO ladm_col_211.lc_usouconstipo (seq,iliCode,itfCode,dispName,inactive,description,thisClass,baseClass) VALUES (NULL,'Residencial.Vivienda_Hasta_3_Pisos',9,'(Residencial) Vivienda hasta 3 pisos','0','Es una casa de tres niveles cuya función arquitectónica y ambiental principal, es dar albergue en forma adecuada a una familia.','Levantamiento_Catastral_V2_11.LC_UsoUConsTipo',NULL);
INSERT INTO ladm_col_211.lc_usouconstipo (seq,iliCode,itfCode,dispName,inactive,description,thisClass,baseClass) VALUES (NULL,'Residencial.Vivienda_Hasta_3_Pisos_En_PH',10,'(Residencial) Vivienda hasta 3 pisos en PH','0','Corresponde a edificaciones residenciales desarrolladas sobre un lote de terreno que comprende más de tres unidades prediales independientes, generalmente en edificios de varios pisos. Este tipo de vivienda prevé? áreas de servicios comunales cuya propiedad y utilización privada se definen en reglamentos de propiedad horizontal','Levantamiento_Catastral_V2_11.LC_UsoUConsTipo',NULL);
INSERT INTO ladm_col_211.lc_usouconstipo (seq,iliCode,itfCode,dispName,inactive,description,thisClass,baseClass) VALUES (NULL,'Residencial.Vivienda_Recreacional',11,'(Residencial) Vivienda Recreacional','0','Es una casa cuya función arquitectónica y ambiental principal, es brindar descanso y recreación','Levantamiento_Catastral_V2_11.LC_UsoUConsTipo',NULL);
INSERT INTO ladm_col_211.lc_usouconstipo (seq,iliCode,itfCode,dispName,inactive,description,thisClass,baseClass) VALUES (NULL,'Residencial.Vivienda_Recreacional_En_PH',12,'(Residencial) Vivienda Recreacional en PH','0','Es una casa cuya función arquitectónica y ambiental principal, es brindar descanso y recreación. Este tipo de vivienda  prevé? áreas de servicios comunales cuya propiedad y utilización privada se definen en reglamentos de propiedad horizontal.','Levantamiento_Catastral_V2_11.LC_UsoUConsTipo',NULL);
INSERT INTO ladm_col_211.lc_usouconstipo (seq,iliCode,itfCode,dispName,inactive,description,thisClass,baseClass) VALUES (NULL,'Comercial.Aulas_de_Clases',13,'(Comercial) Aulas de Clases','0','Es un salón de un edificio que se destina a actividades de enseñanza, y es la unidad básica de todo recinto destinado a la educación.','Levantamiento_Catastral_V2_11.LC_UsoUConsTipo',NULL);
