INSERT INTO ladm_col_211.lc_usouconstipo (seq,iliCode,itfCode,dispName,inactive,description,thisClass,baseClass) VALUES (NULL,'Industrial.Industrias',54,'(Industrial) Industrias','0','Conjunto de instalaciones dedicadas a esta actividad de transformar las materias primas en productos elaborados','Levantamiento_Catastral_V2_11.LC_UsoUConsTipo',NULL);
INSERT INTO ladm_col_211.lc_usouconstipo (seq,iliCode,itfCode,dispName,inactive,description,thisClass,baseClass) VALUES (NULL,'Industrial.Industrias_en_PH',55,'(Industrial) Industrias en PH','0','Conjunto de instalaciones sometidas a régimen de propiedad horizontal dedicadas a la actividad de transformar las materias primas en productos elaborados','Levantamiento_Catastral_V2_11.LC_UsoUConsTipo',NULL);
INSERT INTO ladm_col_211.lc_usouconstipo (seq,iliCode,itfCode,dispName,inactive,description,thisClass,baseClass) VALUES (NULL,'Industrial.Talleres',56,'(Industrial) Talleres','0','Es el espacio construido en el que se realiza un trabajo, manual en su origen, bien de tipo artesanal o fabril.','Levantamiento_Catastral_V2_11.LC_UsoUConsTipo',NULL);
INSERT INTO ladm_col_211.lc_usouconstipo (seq,iliCode,itfCode,dispName,inactive,description,thisClass,baseClass) VALUES (NULL,'Anexo.Albercas_Banaderas',57,'(Anexo) Albercas - Banaderas','0','Depósito de agua construido a nivel del terreno con el propósito de almacenar agua, o en el caso de las bañadera con el fin de hacer limpieza al ganado, estas construcciones son cubiertas para guardar de la intemperie.','Levantamiento_Catastral_V2_11.LC_UsoUConsTipo',NULL);
INSERT INTO ladm_col_211.lc_usouconstipo (seq,iliCode,itfCode,dispName,inactive,description,thisClass,baseClass) VALUES (NULL,'Anexo.Beneficiaderos',58,'(Anexo) Beneficiaderos','0','Nombre dado en zonas cafeteras a aquellas construcciones donde realizan el beneficio del café. Consiste en áreas cubiertas dentro de las cuales se encuentran los elementos destinados a la labor de seleccionar, lavar y despulpar el grano y su posterior empaque','Levantamiento_Catastral_V2_11.LC_UsoUConsTipo',NULL);
INSERT INTO ladm_col_211.lc_usouconstipo (seq,iliCode,itfCode,dispName,inactive,description,thisClass,baseClass) VALUES (NULL,'Anexo.Camaroneras',59,'(Anexo) Camaroneras','0','Construcción para el desarrollo de proyectos acuícolas del cultivo de camarones.','Levantamiento_Catastral_V2_11.LC_UsoUConsTipo',NULL);
INSERT INTO ladm_col_211.lc_usouconstipo (seq,iliCode,itfCode,dispName,inactive,description,thisClass,baseClass) VALUES (NULL,'Anexo.Canchas_de_Tenis',60,'(Anexo) Canchas de Tenis','0','Superficie  terreno rectangular cruzada al medio por una red baja.','Levantamiento_Catastral_V2_11.LC_UsoUConsTipo',NULL);
INSERT INTO ladm_col_211.lc_usouconstipo (seq,iliCode,itfCode,dispName,inactive,description,thisClass,baseClass) VALUES (NULL,'Anexo.Carretera',61,'(Anexo) Carretera','0','Es una vía de transporte de dominio y uso público, proyectada y construida fundamentalmente para la circulación de vehículos automóviles','Levantamiento_Catastral_V2_11.LC_UsoUConsTipo',NULL);
INSERT INTO ladm_col_211.lc_usouconstipo (seq,iliCode,itfCode,dispName,inactive,description,thisClass,baseClass) VALUES (NULL,'Anexo.Cimientos_Estructura_Muros_y_Placa_Base',62,'(Anexo) Cimientos, Estructura, Muros y Placa Base','0','Construcción anexa conformada por unos cimientos, muros y placa base','Levantamiento_Catastral_V2_11.LC_UsoUConsTipo',NULL);
INSERT INTO ladm_col_211.lc_usouconstipo (seq,iliCode,itfCode,dispName,inactive,description,thisClass,baseClass) VALUES (NULL,'Anexo.Cocheras_Marraneras_Porquerizas',63,'(Anexo) Cocheras - Marraneras - Porquerizas','0','Construcciòn destinada a la cría y albergue de cerdos. Se utiliza cualesquiera de los tres nombres enunciados según la región donde se ubique; los elementos que la conforman son: estructura, muros y pisos.','Levantamiento_Catastral_V2_11.LC_UsoUConsTipo',NULL);
INSERT INTO ladm_col_211.lc_usouconstipo (seq,iliCode,itfCode,dispName,inactive,description,thisClass,baseClass) VALUES (NULL,'Anexo.Corrales',64,'(Anexo) Corrales','0','Sitio cerrado y descubierto que se utiliza par la cría y albergue de ganado generalmente vacuno. consta de los elementos estructura  y pisos.','Levantamiento_Catastral_V2_11.LC_UsoUConsTipo',NULL);
INSERT INTO ladm_col_211.lc_usouconstipo (seq,iliCode,itfCode,dispName,inactive,description,thisClass,baseClass) VALUES (NULL,'Anexo.Establos_Pesebreras_Caballerizas',65,'(Anexo) Establos - Pesebreras - Caballerizas','0','Lugar cubierto donde se encierra ganado o caballos y/o se realizan actividades propias de su explotación, constituidos por estructura, cubierta, muros y pisos.','Levantamiento_Catastral_V2_11.LC_UsoUConsTipo',NULL);
INSERT INTO ladm_col_211.lc_usouconstipo (seq,iliCode,itfCode,dispName,inactive,description,thisClass,baseClass) VALUES (NULL,'Anexo.Fuertes_y_Castillos',66,'(Anexo) Fuertes y Castillos','0','Lugar construido  fuerte, cercado de murallas, baluartes, fosos y otras fortificaciones.','Levantamiento_Catastral_V2_11.LC_UsoUConsTipo',NULL);
INSERT INTO ladm_col_211.lc_usouconstipo (seq,iliCode,itfCode,dispName,inactive,description,thisClass,baseClass) VALUES (NULL,'Anexo.Galpones_Gallineros',67,'(Anexo) Galpones - Gallineros','0','Unidad construida con destino a la cría y/o protección de aves principalmente para explotación avícola.  Conformada por estructura cubierta pisos y muros que son parcialmente elaborados en ladrillo y el resto descubierto o con algún material provisional (plásticos, alambres, etc.).','Levantamiento_Catastral_V2_11.LC_UsoUConsTipo',NULL);
INSERT INTO ladm_col_211.lc_usouconstipo (seq,iliCode,itfCode,dispName,inactive,description,thisClass,baseClass) VALUES (NULL,'Anexo.Instalaciones_Militares',68,'Instalaciones militares','0','Construcciones adaptadas o utilizadas por los organismos de seguridad de una nación para acuartelar a las tropas y sus equipos. Estas son organizadas de una forma tal que les facilite cumplir con la rutina diaria de los cuerpos militares, desde dormitorios, patios de ejercicios, estacionamientos para los vehículos, parques, comedores, oficinas y son fortificadas a fin de presentar resistencia al momento de un posible ataque externo.','Levantamiento_Catastral_V2_11.LC_UsoUConsTipo',NULL);
INSERT INTO ladm_col_211.lc_usouconstipo (seq,iliCode,itfCode,dispName,inactive,description,thisClass,baseClass) VALUES (NULL,'Anexo.Kioscos',69,'(Anexo) Kioscos','0','Construcción consistente en una cubierta apoyada en columnas de materiales diferentes, elaborados con el fin de guarecer de la intemperie.','Levantamiento_Catastral_V2_11.LC_UsoUConsTipo',NULL);
INSERT INTO ladm_col_211.lc_usouconstipo (seq,iliCode,itfCode,dispName,inactive,description,thisClass,baseClass) VALUES (NULL,'Anexo.Lagunas_de_Oxidacion',70,'(Anexo) Lagunas de Oxidación','0','Son depósitos construidos mediante la excavación y compactación de la tierra que almacenan agua de cualquier calidad por un periodo determinado','Levantamiento_Catastral_V2_11.LC_UsoUConsTipo',NULL);
INSERT INTO ladm_col_211.lc_usouconstipo (seq,iliCode,itfCode,dispName,inactive,description,thisClass,baseClass) VALUES (NULL,'Anexo.Marquesinas_Patios_Cubiertos',71,'(Anexo) Marquesinas - Patios Cubiertos','0','Cobertizo dentro de una edificación de mayor extensión o patio cubierto, clasificados según su estructura, pisos y el material de la cubierta.','Levantamiento_Catastral_V2_11.LC_UsoUConsTipo',NULL);
INSERT INTO ladm_col_211.lc_usouconstipo (seq,iliCode,itfCode,dispName,inactive,description,thisClass,baseClass) VALUES (NULL,'Anexo.Muelles',72,'(Anexo) Muelles','0','Deberán diferenciarse de acuerdo a su estructura, longitud, capacidad, usos turísticos o de carga','Levantamiento_Catastral_V2_11.LC_UsoUConsTipo',NULL);
INSERT INTO ladm_col_211.lc_usouconstipo (seq,iliCode,itfCode,dispName,inactive,description,thisClass,baseClass) VALUES (NULL,'Anexo.Murallas',73,'(Anexo) Murallas','0','Se denomina muralla a un muro cerrado destinado a la protección y defensa de determinado sitio.','Levantamiento_Catastral_V2_11.LC_UsoUConsTipo',NULL);
INSERT INTO ladm_col_211.lc_usouconstipo (seq,iliCode,itfCode,dispName,inactive,description,thisClass,baseClass) VALUES (NULL,'Anexo.Piscinas',74,'(Anexo) Piscinas','0','Estanque artificial con destino al deporte o a la recreación.  Se diferencia por sus acabados y especificaciones técnicas para su mantenimiento y operación; sus dimensiones deben darse en unidades de área (m2).','Levantamiento_Catastral_V2_11.LC_UsoUConsTipo',NULL);
INSERT INTO ladm_col_211.lc_usouconstipo (seq,iliCode,itfCode,dispName,inactive,description,thisClass,baseClass) VALUES (NULL,'Anexo.Pista_Aeropuerto',75,'Pista aeropuerto','0','Edificación sin cubierta con que se identifican las pistas de los aeropuertos construidas en asfalto o concreto, incluye la zona o calle de redaje y calles de salida rápida.','Levantamiento_Catastral_V2_11.LC_UsoUConsTipo',NULL);
INSERT INTO ladm_col_211.lc_usouconstipo (seq,iliCode,itfCode,dispName,inactive,description,thisClass,baseClass) VALUES (NULL,'Anexo.Pozos',76,'(Anexo) Pozos','0','Perforaciones profundas  manuales para extraer agua subterránea.  Medida en metros de profundidad.','Levantamiento_Catastral_V2_11.LC_UsoUConsTipo',NULL);
INSERT INTO ladm_col_211.lc_usouconstipo (seq,iliCode,itfCode,dispName,inactive,description,thisClass,baseClass) VALUES (NULL,'Anexo.Ramadas_Cobertizos_Caneyes',77,'(Anexo) Ramadas - Cobertizos - Caneyes','0','Consiste en un sitio cubierto elaborado con el fin de resguardar de la intemperie; el nombre de enramadas, cobertizos o caney se utiliza según la forma de la cubierta y la región donde se ubique.','Levantamiento_Catastral_V2_11.LC_UsoUConsTipo',NULL);
INSERT INTO ladm_col_211.lc_usouconstipo (seq,iliCode,itfCode,dispName,inactive,description,thisClass,baseClass) VALUES (NULL,'Anexo.Secaderos',78,'(Anexo) Secaderos','0','Construcciones elaboradas con el objeto de secar en condiciones naturales el café principalmente, aunque es común su uso en otros productos.  Consta de estructura y pisos para su calificación','Levantamiento_Catastral_V2_11.LC_UsoUConsTipo',NULL);
INSERT INTO ladm_col_211.lc_usouconstipo (seq,iliCode,itfCode,dispName,inactive,description,thisClass,baseClass) VALUES (NULL,'Anexo.Silos',79,'(Anexo) Silos','0','Construcción de grandes dimensiones que sirve para almacén o depósito, se exceptúan los silos cafeteros','Levantamiento_Catastral_V2_11.LC_UsoUConsTipo',NULL);
INSERT INTO ladm_col_211.lc_usouconstipo (seq,iliCode,itfCode,dispName,inactive,description,thisClass,baseClass) VALUES (NULL,'Anexo.Tanques',80,'(Anexo) Tanques','0','Depósitos subterráneos o de altura, construidos en zonas con deficiencias en abastecimiento para el consumo de los habitantes o para el uso agrícola.  El elemento a calificar es la estructura relacionada con la capacidad de almacenamiento medida en metros cúbicos.

Se excluyen de este tipo de construcción los tanques de almacenamiento domiciliario','Levantamiento_Catastral_V2_11.LC_UsoUConsTipo',NULL);
INSERT INTO ladm_col_211.lc_usouconstipo (seq,iliCode,itfCode,dispName,inactive,description,thisClass,baseClass) VALUES (NULL,'Anexo.Toboganes',81,'(Anexo) Toboganes','0','Deslizadores construidos alrededor de piscinas, medidos en metros lineales.  Se clasifican según su altura y materiales de construcción','Levantamiento_Catastral_V2_11.LC_UsoUConsTipo',NULL);
INSERT INTO ladm_col_211.lc_usouconstipo (seq,iliCode,itfCode,dispName,inactive,description,thisClass,baseClass) VALUES (NULL,'Anexo.Torres_de_Enfriamiento',82,'(Anexo) Torres de Enfriamiento','0','Son estructuras diseñadas para disminuir la temperatura del agua y otros medios.','Levantamiento_Catastral_V2_11.LC_UsoUConsTipo',NULL);
