INSERT INTO ladm_col_211.col_fuenteespacialtipo (seq,iliCode,itfCode,dispName,inactive,description,thisClass,baseClass) VALUES (NULL,'Ortofoto',2,'Ortofoto','0','Imagen producto de la toma de fotografías aéreas o satélites, en la cual han sido corregidos los desplazamientos causados por la inclinación de la cámara o sensor y la curvatura de la superficie del terreno. Está referida a un sistema de proyección cartográfica, por lo que posee las características geométricas de un mapa con el factor adicional de que los objetos se encuentran representados de forma real en la imagen de la fotográfica.','LADM_COL_V1_7.LADM_Nucleo.COL_FuenteEspacialTipo',NULL);
