INSERT INTO ladm_col_211.ant_estadociviltipo (seq,iliCode,itfCode,dispName,inactive,description,thisClass,baseClass) VALUES (NULL,'Casado',5,'Está casado(a)','0',NULL,'ANT_V2_11.ANT_EstadoCivilTipo',NULL);
INSERT INTO ladm_col_211.lc_destinacioneconomicatipo (seq,iliCode,itfCode,dispName,inactive,description,thisClass,baseClass) VALUES (NULL,'Acuicola',0,'Acuicola','0','Se califica con destino acuícola, aquellos predios donde se realizan cultivos de organismos acuáticos, en ambientes naturales o artificiales.','Levantamiento_Catastral_V2_11.LC_DestinacionEconomicaTipo',NULL);
INSERT INTO ladm_col_211.lc_destinacioneconomicatipo (seq,iliCode,itfCode,dispName,inactive,description,thisClass,baseClass) VALUES (NULL,'Agricola',1,'Agrícola','0','Se califica con destino agrícola, aquellos predios con funcionalidad de laboreo agrícola, terrenos que han sido transformados y ocupados para la producción de cultivos cuyo objetivo es satisfacer las necesidades alimentarias, comerciales y agrícolas.

En caso de encontrar actividad agrícola y actividad pecuaria en un mismo predio, se califica según la actividad que predomine. Si, ambas actividades tienen el mismo porcentaje de participación en el predio, se debe calificar como agrícola.','Levantamiento_Catastral_V2_11.LC_DestinacionEconomicaTipo',NULL);
INSERT INTO ladm_col_211.lc_destinacioneconomicatipo (seq,iliCode,itfCode,dispName,inactive,description,thisClass,baseClass) VALUES (NULL,'Agroindustrial',2,'Agroindustrial','0','Se califica con destino agroindustrial, aquellos predios destinados a la actividad que implica cultivo (producción) y transformación (industrialización y comercialización) de productos agrícola, pecuario y forestal.','Levantamiento_Catastral_V2_11.LC_DestinacionEconomicaTipo',NULL);
INSERT INTO ladm_col_211.lc_destinacioneconomicatipo (seq,iliCode,itfCode,dispName,inactive,description,thisClass,baseClass) VALUES (NULL,'Agroforestal',3,'Agroforestal','0','Se califica con destino agroforestal, aquellos predios destinados al establecimiento y aprovechamiento combinado de especies forestales con actividades agrícolas o pecuarias con arreglos diferenciados. Incluye la actividad agrosilvícola, silvopastoril y agrosilvopastoril.','Levantamiento_Catastral_V2_11.LC_DestinacionEconomicaTipo',NULL);
INSERT INTO ladm_col_211.lc_destinacioneconomicatipo (seq,iliCode,itfCode,dispName,inactive,description,thisClass,baseClass) VALUES (NULL,'Comercial',4,'Comercial','0','Se califica con destino comercial, aquellos predios cuya finalidad es la de realizar la actividad económica de ofrecer, transar o almacenar bienes y/o servicios a través de un mercader o comerciante.','Levantamiento_Catastral_V2_11.LC_DestinacionEconomicaTipo',NULL);
INSERT INTO ladm_col_211.lc_destinacioneconomicatipo (seq,iliCode,itfCode,dispName,inactive,description,thisClass,baseClass) VALUES (NULL,'Cultural',5,'Cultural','0','Se califica con destino cultural, aquellos predios considerados como bienes culturales de la nación, además los espacios destinados al desarrollo de actividades artísticas.','Levantamiento_Catastral_V2_11.LC_DestinacionEconomicaTipo',NULL);
INSERT INTO ladm_col_211.lc_destinacioneconomicatipo (seq,iliCode,itfCode,dispName,inactive,description,thisClass,baseClass) VALUES (NULL,'Educativo',6,'Educativo','0','Se califica con destino educativo, aquellos predios donde se desarrollan actividades académicas, tanto de la educación inicial, preescolar, básica, media y superior. Incluye los jardines, escuelas, colegios, institutos técnicos, fundaciones educativas, centros de investigación y universidades.','Levantamiento_Catastral_V2_11.LC_DestinacionEconomicaTipo',NULL);
INSERT INTO ladm_col_211.lc_destinacioneconomicatipo (seq,iliCode,itfCode,dispName,inactive,description,thisClass,baseClass) VALUES (NULL,'Forestal',7,'Forestal','0','Se califica con destino forestal, aquellos predios con áreas naturales o seminaturales, constituidas principalmente por elementos arbóreos de especies nativas, exóticas e introducidas.  Incluye las plantaciones forestales comerciales y los bosques naturales y seminaturales.','Levantamiento_Catastral_V2_11.LC_DestinacionEconomicaTipo',NULL);
INSERT INTO ladm_col_211.lc_destinacioneconomicatipo (seq,iliCode,itfCode,dispName,inactive,description,thisClass,baseClass) VALUES (NULL,'Habitacional',8,'Habitacional','0','Se califica con destino habitacional, aquellos predios de uso residencial cuya finalidad es la vivienda habitual de las personas. Incluye los parqueaderos, garajes y depósitos dentro de propiedad horizontal como también los predios rurales de vivienda campestre.','Levantamiento_Catastral_V2_11.LC_DestinacionEconomicaTipo',NULL);
INSERT INTO ladm_col_211.lc_destinacioneconomicatipo (seq,iliCode,itfCode,dispName,inactive,description,thisClass,baseClass) VALUES (NULL,'Industrial',9,'Institucional','0','Se califica con destino industrial, aquellos predios donde se desarrollan actividades de producción, fabricación, preparación, recuperación, reproducción, ensamblaje, construcción, transformación, tratamiento y manipulación de materias primas para producir bienes o productos materiales y que no estén clasificados dentro de los predios mineros.','Levantamiento_Catastral_V2_11.LC_DestinacionEconomicaTipo',NULL);
INSERT INTO ladm_col_211.lc_destinacioneconomicatipo (seq,iliCode,itfCode,dispName,inactive,description,thisClass,baseClass) VALUES (NULL,'Infraestructura_Asociada_Produccion_Agropecuaria',10,'Infraestructura asociada a producción agropecuaria','0','Se califica con destino infraestructura asociada a la producción agropecuaria, aquellos predios sobre los cuales se encuentra la infraestructura requerida dentro de la actividad agropecuaria y que son de interés para el sector agropecuario, como: bancos de maquinaria, plantas de almacenamiento, centros de acopio, centros de transformación agrícola, mataderos, etc.','Levantamiento_Catastral_V2_11.LC_DestinacionEconomicaTipo',NULL);
INSERT INTO ladm_col_211.lc_destinacioneconomicatipo (seq,iliCode,itfCode,dispName,inactive,description,thisClass,baseClass) VALUES (NULL,'Infraestructura_Hidraulica',11,'Infraestructura hidráulica','0','Se califica con destino infraestructura hidráulica, aquellos predios sobre los cuales se encuentra establecida infraestructura para controlar, almacenar y conducir un flujo continuo de agua. Incluye los embalses, represas, acueductos, centrales de tratamiento y distribución, alcantarillados, estaciones depuradoras de aguas residenciales y distrito de adecuación de tierras.','Levantamiento_Catastral_V2_11.LC_DestinacionEconomicaTipo',NULL);
INSERT INTO ladm_col_211.lc_destinacioneconomicatipo (seq,iliCode,itfCode,dispName,inactive,description,thisClass,baseClass) VALUES (NULL,'Infraestructura_Saneamiento_Basico',12,'Infraestructura saneamiento','0','Se califica con destino infraestructura de saneamiento básico, aquellos predios sobre los cuales se encuentra establecida la infraestructura para el saneamiento básico, con excepción del alcantarillado. Incluye los centros de acopio de basura y material reciclable, rellenos sanitarios e incineradoras.','Levantamiento_Catastral_V2_11.LC_DestinacionEconomicaTipo',NULL);
INSERT INTO ladm_col_211.lc_destinacioneconomicatipo (seq,iliCode,itfCode,dispName,inactive,description,thisClass,baseClass) VALUES (NULL,'Infraestructura_Seguridad',13,'Infraestructura seguridad','0','Se califica con destino infraestructura de seguridad, aquellos predios sobre los cuales se encuentra establecida infraestructura destina a salvaguardar el orden público. Incluye las estaciones de policía, batallones, cárceles, etc.','Levantamiento_Catastral_V2_11.LC_DestinacionEconomicaTipo',NULL);
INSERT INTO ladm_col_211.lc_destinacioneconomicatipo (seq,iliCode,itfCode,dispName,inactive,description,thisClass,baseClass) VALUES (NULL,'Infraestructura_Transporte',14,'Infraestructura transporte','0','Se califica con destino infraestructura de transporte, aquellos predios en los cuales se encuentra establecida infraestructura para el desarrollo de actividad de transporte, muelles para embarque, desembarque de carga y/o pasajeros, pistas de aterrizaje, torres de control, centros de almacenamiento y venta de combustible, etc. Se exceptúan de estas, aquellas plataformas flotantes y aquellas que se encuentren fuera de la plataforma continental.','Levantamiento_Catastral_V2_11.LC_DestinacionEconomicaTipo',NULL);
INSERT INTO ladm_col_211.lc_destinacioneconomicatipo (seq,iliCode,itfCode,dispName,inactive,description,thisClass,baseClass) VALUES (NULL,'Institucional',15,'Institucional','0','Se califica con destino institucional, aquellos predios destinados a la administración y prestación de servicios del Estado tanto de orden nacional como territorial.','Levantamiento_Catastral_V2_11.LC_DestinacionEconomicaTipo',NULL);
INSERT INTO ladm_col_211.lc_destinacioneconomicatipo (seq,iliCode,itfCode,dispName,inactive,description,thisClass,baseClass) VALUES (NULL,'Mineria_Hidrocarburos',16,'Minería hidrocarburos','0','Se califica con destino minería e hidrocarburos, aquellos predios donde se hace aprovechamiento directo de los recursos minerales o transformación primaria de los mismos.','Levantamiento_Catastral_V2_11.LC_DestinacionEconomicaTipo',NULL);
INSERT INTO ladm_col_211.lc_destinacioneconomicatipo (seq,iliCode,itfCode,dispName,inactive,description,thisClass,baseClass) VALUES (NULL,'Lote_Urbanizable_No_Urbanizado',17,'Lote urbanizable no urbanizado','0','Se califica con este destino, aquellos predios urbanos no construidos, ubicados en terrenos de grandes áreas que no han sido desarrollados y sin restricción legal para adelantar algún tipo de desarrollo urbanístico.','Levantamiento_Catastral_V2_11.LC_DestinacionEconomicaTipo',NULL);
INSERT INTO ladm_col_211.lc_destinacioneconomicatipo (seq,iliCode,itfCode,dispName,inactive,description,thisClass,baseClass) VALUES (NULL,'Lote_Urbanizado_No_Construido',18,'Lote urbanizado no construido','0','Se califica con este destino, aquellos predios urbanos no construidos, ubicados en zonas urbanizadas, es decir, con infraestructura de servicios públicos e infraestructura vial.','Levantamiento_Catastral_V2_11.LC_DestinacionEconomicaTipo',NULL);
INSERT INTO ladm_col_211.lc_destinacioneconomicatipo (seq,iliCode,itfCode,dispName,inactive,description,thisClass,baseClass) VALUES (NULL,'Lote_No_Urbanizable',19,'Lote no urbanizable','0','Se califica con este destino, aquellos predios urbanos o rurales clasificados por el instrumento de planeación como suelo de protección, también se incluyen los predios con afectación, por ejemplo los utilizados como servidumbres para los servicios públicos.','Levantamiento_Catastral_V2_11.LC_DestinacionEconomicaTipo',NULL);
INSERT INTO ladm_col_211.lc_destinacioneconomicatipo (seq,iliCode,itfCode,dispName,inactive,description,thisClass,baseClass) VALUES (NULL,'Pecuario',20,'Pecuario','0','Se califica con destino pecuario, aquellos predios destinados a la cría, beneficio y aprovechamiento de especies de animales no domésticos, para el consumo humano (productos cárnicos y lácteos), uso artesanal (lana, cuero, plumas, etc.) y conservación de fauna (zoocría).','Levantamiento_Catastral_V2_11.LC_DestinacionEconomicaTipo',NULL);
INSERT INTO ladm_col_211.lc_destinacioneconomicatipo (seq,iliCode,itfCode,dispName,inactive,description,thisClass,baseClass) VALUES (NULL,'Recreacional',21,'Recreacional','0','Se califica con destino recreacional, aquellos predios que corresponden a equipamientos deportivos y recreativos, parques de propiedad privada o pública, clubes, generando bienestar físico y social.','Levantamiento_Catastral_V2_11.LC_DestinacionEconomicaTipo',NULL);
INSERT INTO ladm_col_211.lc_destinacioneconomicatipo (seq,iliCode,itfCode,dispName,inactive,description,thisClass,baseClass) VALUES (NULL,'Religioso',22,'Religioso','0','Se califica con destino religioso, aquellos predios cuya finalidad es el culto religioso público, incluye las parroquias, basílicas, catedrales, santuarios, capillas, colegiatas, monasterios, conventos y seminarios.','Levantamiento_Catastral_V2_11.LC_DestinacionEconomicaTipo',NULL);
INSERT INTO ladm_col_211.lc_destinacioneconomicatipo (seq,iliCode,itfCode,dispName,inactive,description,thisClass,baseClass) VALUES (NULL,'Salubridad',23,'Salubridad','0','Se califica con destino salubridad, aquellos predios destinados al cuidado de la salud de los ciudadanos, incluye los hospitales, centros de salud, clínicas, laboratorios y consultorios que prestan el servicio de salud tanto carácter público o privado','Levantamiento_Catastral_V2_11.LC_DestinacionEconomicaTipo',NULL);
INSERT INTO ladm_col_211.lc_destinacioneconomicatipo (seq,iliCode,itfCode,dispName,inactive,description,thisClass,baseClass) VALUES (NULL,'Uso_Publico',24,'Uso público','0','Se califica con destino uso público, aquellos predios urbanos o rurales, que conforman el espacio público, como las zonas verdes, alamedas, plazas (no se incluyen las plazas de mercado), plazoletas parques, cuerpos de agua, áreas de control y protección ambiental, túneles, vías, ciclorutas, glorietas, etc.','Levantamiento_Catastral_V2_11.LC_DestinacionEconomicaTipo',NULL);
INSERT INTO ladm_col_211.av_usosueloruraltipo (seq,iliCode,itfCode,dispName,inactive,description,thisClass,baseClass) VALUES (NULL,'Edificios',0,'Edificios','0','Comprende la agrupación de edificaciones de tipo habitacional, industrial, comercial e institucional que no estén consideradas dentro del plan de ordenamiento territorial como parte de la zona urbana ej. Caseríos, zonas industriales, universidades.','Avaluos_V2_11.AV_UsoSueloRuralTipo',NULL);
INSERT INTO ladm_col_211.av_usosueloruraltipo (seq,iliCode,itfCode,dispName,inactive,description,thisClass,baseClass) VALUES (NULL,'Otras_Construcciones',1,'Otras construcciones','0','Comprende construcciones de otro tipo diferente a edificios por su tamaño o actividad ej, represas, aeropuertos, centrales hidroeléctricas, estadios, plazas de toros, bases militares.','Avaluos_V2_11.AV_UsoSueloRuralTipo',NULL);
INSERT INTO ladm_col_211.av_usosueloruraltipo (seq,iliCode,itfCode,dispName,inactive,description,thisClass,baseClass) VALUES (NULL,'Parques_Naturales',2,'Parques naturales','0','Son áreas naturales definidas y delimitadas oficialmente poco transformadas por la explotación u ocupación humana que, en razón a la belleza de sus paisajes, la representatividad de sus ecosistemas o la singularidad de su flora, de su fauna o de sus formaciones geomorfológicas, poseen unos valores ecológicos, estéticos, educativos y científicos cuya conservación merece una atención preferente.','Avaluos_V2_11.AV_UsoSueloRuralTipo',NULL);
INSERT INTO ladm_col_211.av_usosueloruraltipo (seq,iliCode,itfCode,dispName,inactive,description,thisClass,baseClass) VALUES (NULL,'Cultivos_De_Caracter_Permanente',3,'Cultivos de carácter permanente','0','Aquellos cultivos tales como café, palma africana, palma africana, palma de coco, caucho, cítricos, arboles maderables, aguacate, guayabo, mango, manzano, pera, durazno, uva, noli, fique, cacao y cualquier otro cultivo que exija un periodo superior a tres años entre su siembre y su cosecha, o cuyo periodo de producción se prolongue por mas de cinco años.','Avaluos_V2_11.AV_UsoSueloRuralTipo',NULL);
INSERT INTO ladm_col_211.av_usosueloruraltipo (seq,iliCode,itfCode,dispName,inactive,description,thisClass,baseClass) VALUES (NULL,'Tierras_De_Labor_Irrigadas',4,'Tierras de labor irrigadas','0','Aquellas tierras que para su producción cuentan con aplicación de agua, que de suyo falta para el desarrollo del cultivo, mediante la utilización de un sistema de irrigación.','Avaluos_V2_11.AV_UsoSueloRuralTipo',NULL);
INSERT INTO ladm_col_211.av_usosueloruraltipo (seq,iliCode,itfCode,dispName,inactive,description,thisClass,baseClass) VALUES (NULL,'Tierras_De_Labor_No_Irrigadas',5,'Tierras de labor no irrigadas','0','Aquellas tierras que carecen de un sistema de irrigación y que para su producción dependen exclusivamente del agua lluvia ciada sobre ellas.','Avaluos_V2_11.AV_UsoSueloRuralTipo',NULL);
INSERT INTO ladm_col_211.av_usosueloruraltipo (seq,iliCode,itfCode,dispName,inactive,description,thisClass,baseClass) VALUES (NULL,'Tierras_Con_Maleza',6,'Tierras con maleza','0','Aquellas tierras en donde predominen las plantaciones espontaneas de arbustos que obstaculizan la utilización económica del suelo.','Avaluos_V2_11.AV_UsoSueloRuralTipo',NULL);
INSERT INTO ladm_col_211.av_usosueloruraltipo (seq,iliCode,itfCode,dispName,inactive,description,thisClass,baseClass) VALUES (NULL,'Tierras_Improductivas',7,'Tierras improductivas','0','Aquellas áreas que por sus condiciones topográficas, climatológicas y que en general por las características físicas o químicas de sus suelos no puedan ser explotadas.','Avaluos_V2_11.AV_UsoSueloRuralTipo',NULL);
INSERT INTO ladm_col_211.av_usosueloruraltipo (seq,iliCode,itfCode,dispName,inactive,description,thisClass,baseClass) VALUES (NULL,'Pastos_Naturales',8,'Pastos naturales','0','Conjuntos de herbáceos forrajeros producidos espontáneamente por el suelo.','Avaluos_V2_11.AV_UsoSueloRuralTipo',NULL);
INSERT INTO ladm_col_211.av_usosueloruraltipo (seq,iliCode,itfCode,dispName,inactive,description,thisClass,baseClass) VALUES (NULL,'Pastos_Artificales',9,'Pastos artificiales','0','Conjunto de cultivos herbáceos forrajeros no producidos espontáneamente.','Avaluos_V2_11.AV_UsoSueloRuralTipo',NULL);
INSERT INTO ladm_col_211.av_usosueloruraltipo (seq,iliCode,itfCode,dispName,inactive,description,thisClass,baseClass) VALUES (NULL,'Pastos_Naturales_Mejorados',10,'Pastos naturales mejorados','0','Pastos naturales sometidos a prácticas técnicas de uso y manejo','Avaluos_V2_11.AV_UsoSueloRuralTipo',NULL);
INSERT INTO ladm_col_211.av_usosueloruraltipo (seq,iliCode,itfCode,dispName,inactive,description,thisClass,baseClass) VALUES (NULL,'Bosques',11,'Bosques','0','Conjunto de plantaciones naturales o de cultivos de arboles de igual o distinta naturaleza que están en explotación o pueden ser explotados.','Avaluos_V2_11.AV_UsoSueloRuralTipo',NULL);
INSERT INTO ladm_col_211.av_usosueloruraltipo (seq,iliCode,itfCode,dispName,inactive,description,thisClass,baseClass) VALUES (NULL,'Selvas_Virgenes',12,'Selvas vírgenes','0','Terrenos extensos, incultos y abundantemente poblados con vegetación arbórea y nativa.','Avaluos_V2_11.AV_UsoSueloRuralTipo',NULL);
INSERT INTO ladm_col_211.av_usosueloruraltipo (seq,iliCode,itfCode,dispName,inactive,description,thisClass,baseClass) VALUES (NULL,'Cuerpos_De_Agua',13,'Cuerpos de agua','0','Comprende aquellas área cubiertas de agua con carácter permanente que puede ser de origen natural o artificial.','Avaluos_V2_11.AV_UsoSueloRuralTipo',NULL);
INSERT INTO ladm_col_211.av_usosueloruraltipo (seq,iliCode,itfCode,dispName,inactive,description,thisClass,baseClass) VALUES (NULL,'Condiciones_Especiales',14,'Condiciones especiales','0','Comprende aquellas edificaciones que por sus características especiales por actividad son diferentes a las anteriores ej. Condominios, parcelaciones, parques recreacionales.','Avaluos_V2_11.AV_UsoSueloRuralTipo',NULL);
INSERT INTO ladm_col_211.av_usosueloruraltipo (seq,iliCode,itfCode,dispName,inactive,description,thisClass,baseClass) VALUES (NULL,'Mixto',15,'Mixto','0','Al clasificar usos mixtos, se agrupan máximo 2 tipos de uso que son de difícil separación por la escala de mapeo, considérelos como, una unidad miscelánea pero destaque el uso dominante designándolo con un número fraccionario en que el numerador sea el elemento dominante','Avaluos_V2_11.AV_UsoSueloRuralTipo',NULL);
INSERT INTO ladm_col_211.ant_motivoconsideracionderechotipo (seq,iliCode,itfCode,dispName,inactive,description,thisClass,baseClass) VALUES (NULL,'Compra',0,'Porque lo compró','0',NULL,'ANT_V2_11.ANT_MotivoConsideracionDerechoTipo',NULL);
INSERT INTO ladm_col_211.ant_motivoconsideracionderechotipo (seq,iliCode,itfCode,dispName,inactive,description,thisClass,baseClass) VALUES (NULL,'Sentencia_Judicial',1,'Porque tiene una sentencia judicial','0',NULL,'ANT_V2_11.ANT_MotivoConsideracionDerechoTipo',NULL);
INSERT INTO ladm_col_211.ant_motivoconsideracionderechotipo (seq,iliCode,itfCode,dispName,inactive,description,thisClass,baseClass) VALUES (NULL,'Herencia',2,'Porque es una herencia','0',NULL,'ANT_V2_11.ANT_MotivoConsideracionDerechoTipo',NULL);
INSERT INTO ladm_col_211.ant_motivoconsideracionderechotipo (seq,iliCode,itfCode,dispName,inactive,description,thisClass,baseClass) VALUES (NULL,'Donacion',3,'Porque es una donación','0',NULL,'ANT_V2_11.ANT_MotivoConsideracionDerechoTipo',NULL);
INSERT INTO ladm_col_211.ant_motivoconsideracionderechotipo (seq,iliCode,itfCode,dispName,inactive,description,thisClass,baseClass) VALUES (NULL,'Lo_Trabaja',4,'Porque lo trabaja','0',NULL,'ANT_V2_11.ANT_MotivoConsideracionDerechoTipo',NULL);
