INSERT INTO ladm_col_211.col_fuenteadministrativatipo (seq,iliCode,itfCode,dispName,inactive,description,thisClass,baseClass) VALUES (NULL,'Documento_Publico',0,'Documento público','0','Documento público es el otorgado por el funcionario público en ejercicio de sus funciones o con su intervención. Así mismo, es público el documento otorgado por un particular en ejercicio de funciones públicas o con su intervención. Cuando consiste en un escrito autorizado o suscrito por el respectivo funcionario, es instrumento público; cuando es autorizado por un notario o quien haga sus veces y ha sido incorporado en el respectivo protocolo, se denomina escritura pública.','LADM_COL_V1_7.LADM_Nucleo.COL_FuenteAdministrativaTipo',NULL);
INSERT INTO ladm_col_211.col_fuenteadministrativatipo (seq,iliCode,itfCode,dispName,inactive,description,thisClass,baseClass) VALUES (NULL,'Documento_Privado',1,'Documento privado','0','El documento privado es aquel documento que no cumple los requisitos del documento público, es decir, es un documento que no ha sido elaborado por un funcionario público, ni ha habido intervención de éste para su elaboración.','LADM_COL_V1_7.LADM_Nucleo.COL_FuenteAdministrativaTipo',NULL);
