INSERT INTO ladm_col_211.lc_procedimientocatastralregistraltipo (seq,iliCode,itfCode,dispName,inactive,description,thisClass,baseClass) VALUES (NULL,'Actualizacion_Linderos',0,'Actualización linderos con efectos registrales','0','El gestor catastral competente, de oficio o a solicitud de parte del titular del derecho de dominio, o de las entidades públicas que con ocasión de sus funciones legales administran inmuebles propios o ajenos, podrán efectuar la actualización mediante la descripción técnica de linderos de bienes inmuebles, cuando sean verificables mediante métodos directos y/o indirectos sin variación, o cuando la variación o diferencia se encuentre dentro de los márgenes de tolerancia establecidos por la máxima autoridad catastral. La descripción de los linderos llevará a la certeza del área. Articulo 2.2.2.2.17. Decreto 148 de 2020.','Levantamiento_Catastral_V2_11.LC_ProcedimientoCatastralRegistralTipo',NULL);
INSERT INTO ladm_col_211.lc_procedimientocatastralregistraltipo (seq,iliCode,itfCode,dispName,inactive,description,thisClass,baseClass) VALUES (NULL,'Rectificacion_Area',1,'Rectificación de área por imprecisa determinación con efectos registrales','0','La rectificación de área en el sistema catastral y/o registral procederá ante el gestor catastral, de oficio o a solicitud de parte del titular  del derecho de dominio, o de las entidades públicas que con ocasión de sus funciones legales administran inmuebles propios o ajenos, cuando los linderos estén debida y técnicamente descritos, sean verificables mediante métodos directos y/o indirectos sin variación, pero que a lo largo de la tradición del bien inmueble el área de éste no haya sido determinada adecuadamente, o cuando la variación o diferencia se encuentre dentro de los márgenes de tolerancia establecidos por la máxima autoridad catastral. Artículo 2.2.2.2.17. Decreto 148 de 2020.','Levantamiento_Catastral_V2_11.LC_ProcedimientoCatastralRegistralTipo',NULL);
INSERT INTO ladm_col_211.lc_procedimientocatastralregistraltipo (seq,iliCode,itfCode,dispName,inactive,description,thisClass,baseClass) VALUES (NULL,'Rectificacion_Linderos',2,'Rectificación de linderos por acuerdo entre las partes con efectos registrales','0','La rectificación de linderos en el sistema catastral y registral procederá de oficio o a solicitud de parte, ante el gestor catastral, siempre y cuando se haya suscrito acta de colindancia con pleno acuerdo entre los propietarios que compartan uno o varios linderos, pero se adviertan diferencias de linderos y áreas, entre la verificación mediante métodos directos y/o indirectos y la información del folio de matricula inmobiliaria. La rectificación de todos los linderos puede llevar a la certeza del área del inmueble. Artículo 2.2.2.2.17. Decreto 148 de 2020.','Levantamiento_Catastral_V2_11.LC_ProcedimientoCatastralRegistralTipo',NULL);
INSERT INTO ladm_col_211.av_usouconstipo (seq,iliCode,itfCode,dispName,inactive,description,thisClass,baseClass) VALUES (NULL,'Residencial.Apartamentos_4_y_mas_pisos_en_PH',0,'(Residencial) Apartamentos 4 y más pisos en PH','0','Es una vivienda que comprende una o más habitaciones, en un edificio de varios pisos 4 o más pisos sometido en régimen de propiedad horizontal.','Avaluos_V2_11.AV_UsoUConsTipo',NULL);
