INSERT INTO ladm_col_211.av_usouconstipo (seq,iliCode,itfCode,dispName,inactive,description,thisClass,baseClass) VALUES (NULL,'Residencial.Depositos_Lockers',5,'Depósitos o lockers','0','(en propiedad Horizontal): Edificación destinada al almacenamiento o resguardo de enceres, generalmente ubicados en los sótanos y semisótanos de los edificios, junto a los parqueaderos. Las áreas de estos depósitos generalmente no supera los 25 metros cuadrados.','Avaluos_V2_11.AV_UsoUConsTipo',NULL);
