INSERT INTO ladm_col_211.av_usouconstipo (seq,iliCode,itfCode,dispName,inactive,description,thisClass,baseClass) VALUES (NULL,'Residencial.Vivienda_Colonial',8,'(Residencial) Vivienda Colonial','0','La vivienda colonial siempre se desarrolla en un solo nivel ya sea en la planta baja o en la planta alta de las edificaciones, sin importar la jerarquía de ‘estas, distribuida en crujías o bloques, paralelos o perpendiculares a la calle en forma de  “I” ,de “L”, de “C” o de “O”','Avaluos_V2_11.AV_UsoUConsTipo',NULL);
