INSERT INTO ladm_col_211.av_usouconstipo (seq,iliCode,itfCode,dispName,inactive,description,thisClass,baseClass) VALUES (NULL,'Anexo.Albercas_Banaderas',57,'(Anexo) Albercas - Banaderas','0','Depósito de agua construido a nivel del terreno con el propósito de almacenar agua, o en el caso de las bañadera con el fin de hacer limpieza al ganado, estas construcciones son cubiertas para guardar de la intemperie.','Avaluos_V2_11.AV_UsoUConsTipo',NULL);
