INSERT INTO ladm_col_211.av_usouconstipo (seq,iliCode,itfCode,dispName,inactive,description,thisClass,baseClass) VALUES (NULL,'Anexo.Cimientos_Estructura_Muros_y_Placa_Base',62,'(Anexo) Cimientos, Estructura, Muros y Placa Base','0','Construcción anexa conformada por unos cimientos, muros y placa base','Avaluos_V2_11.AV_UsoUConsTipo',NULL);
INSERT INTO ladm_col_211.av_usouconstipo (seq,iliCode,itfCode,dispName,inactive,description,thisClass,baseClass) VALUES (NULL,'Anexo.Cocheras_Marraneras_Porquerizas',63,'(Anexo) Cocheras - Marraneras - Porquerizas','0','Construcciòn destinada a la cría y albergue de cerdos. Se utiliza cualesquiera de los tres nombres enunciados según la región donde se ubique; los elementos que la conforman son: estructura, muros y pisos.','Avaluos_V2_11.AV_UsoUConsTipo',NULL);
