INSERT INTO ladm_col_211.av_usouconstipo (seq,iliCode,itfCode,dispName,inactive,description,thisClass,baseClass) VALUES (NULL,'Anexo.Establos_Pesebreras_Caballerizas',65,'(Anexo) Establos - Pesebreras - Caballerizas','0','Lugar cubierto donde se encierra ganado o caballos y/o se realizan actividades propias de su explotación, constituidos por estructura, cubierta, muros y pisos.','Avaluos_V2_11.AV_UsoUConsTipo',NULL);
INSERT INTO ladm_col_211.av_usouconstipo (seq,iliCode,itfCode,dispName,inactive,description,thisClass,baseClass) VALUES (NULL,'Anexo.Fuertes_y_Castillos',66,'(Anexo) Fuertes y Castillos','0','Lugar construido  fuerte, cercado de murallas, baluartes, fosos y otras fortificaciones.','Avaluos_V2_11.AV_UsoUConsTipo',NULL);
INSERT INTO ladm_col_211.av_usouconstipo (seq,iliCode,itfCode,dispName,inactive,description,thisClass,baseClass) VALUES (NULL,'Anexo.Galpones_Gallineros',67,'(Anexo) Galpones - Gallineros','0','Unidad construida con destino a la cría y/o protección de aves principalmente para explotación avícola.  Conformada por estructura cubierta pisos y muros que son parcialmente elaborados en ladrillo y el resto descubierto o con algún material provisional (plásticos, alambres, etc.).','Avaluos_V2_11.AV_UsoUConsTipo',NULL);
INSERT INTO ladm_col_211.av_usouconstipo (seq,iliCode,itfCode,dispName,inactive,description,thisClass,baseClass) VALUES (NULL,'Anexo.Instalaciones_Militares',68,'Instalaciones militares','0','Construcciones adaptadas o utilizadas por los organismos de seguridad de una nación para acuartelar a las tropas y sus equipos. Estas son organizadas de una forma tal que les facilite cumplir con la rutina diaria de los cuerpos militares, desde dormitorios, patios de ejercicios, estacionamientos para los vehículos, parques, comedores, oficinas y son fortificadas a fin de presentar resistencia al momento de un posible ataque externo.','Avaluos_V2_11.AV_UsoUConsTipo',NULL);
