  !!@ ili2db.mapping = "MultiLine"
STRUCTURE GM_MultiCurve3D =
    geometry : LIST {1..*} OF ISO19107_PLANAS_V2.GM_Curve3DListValue;
  END GM_MultiCurve3D;

  !!@ ili2db.mapping = "MultiSurface"
STRUCTURE GM_MultiSurface3D =
