MODEL Datos_Integracion_Insumos_V2_11 (es)
AT "mailto:PC4@localhost"
VERSION "2019-09-06"  =
  IMPORTS Datos_Gestor_Catastral_V2_11,Datos_SNR_V2_11;

  DOMAIN

    INI_ConfiabilidadTipo = (
      !!@ ili2db.dispName = "Muy confiable"
      Muy_Confiable,
      !!@ ili2db.dispName = "Medianamente confiable"
      Medianamente_Confiable,
      !!@ ili2db.dispName = "Poco confiable"
      Poco_Confiable
    );

  TOPIC Datos_Integracion_Insumos =
    DEPENDS ON Datos_SNR_V2_11.Datos_SNR,Datos_Gestor_Catastral_V2_11.Datos_Gestor_Catastral;

    /** Clase que relaciona los predios en los modelos de insumos para el Gestor Catastral y la SNR.
     */
