    CLASS INI_PredioInsumos =
      /** Confiabilidad de la relación.
       */
      !!@ ili2db.dispName = "Confiabilidad"
      Confiabilidad : Datos_Integracion_Insumos_V2_11.INI_ConfiabilidadTipo;
      /** Observaciones de la relación.
       */
      !!@ ili2db.dispName = "Observaciones"
      Observaciones : TEXT;
    END INI_PredioInsumos;

    ASSOCIATION ini_predio_integracion_gc =
      gc_predio_catastro (EXTERNAL) -- {0..1} Datos_Gestor_Catastral_V2_11.Datos_Gestor_Catastral.GC_PredioCatastro;
      ini_predio_insumos -- {0..*} INI_PredioInsumos;
    END ini_predio_integracion_gc;

    ASSOCIATION ini_predio_integracion_snr =
      snr_predio_juridico (EXTERNAL) -- {0..1} Datos_SNR_V2_11.Datos_SNR.SNR_PredioRegistro;
      ini_predio -- {0..*} INI_PredioInsumos;
    END ini_predio_integracion_snr;

  END Datos_Integracion_Insumos;

END Datos_Integracion_Insumos_V2_11.
